INSERT INTO `wp_law_banfa` VALUES (1,'第一条  根据《中华人民共和国道路交通安全法》（以下简称《道路交通安全法》）、《中华人民共和国道路交通安全法实施条例》（以下简称《实施条例》），结合本省实际，制定本办法。\n'),(2,'第二条  本省行政区域内的车辆驾驶人、行人、乘车人以及与道路交通活动有关的单位和个人，都应当遵守本办法。'),(3,'第三条  县级以上人民政府应当保障道路交通安全管理工作与经济建设和社会发展相适应，保障道路交通安全经费，完善道路基础设施；建立和落实道路交通安全责任制和交通事故应急机制，建立健全道路交通安全工作协调机制，将道路交通安全工作纳入安全生产和社会治安综合治理考核范围，定期研究道路交通安全工作，组织道路交通安全状况评估；组织有关部门开展道路交通安全宣传教育，提高全社会道路交通安全意识。\n乡镇人民政府、街道办事处应当按照职责做好本辖区内的道路交通安全管理工作，加强道路交通安全宣传教育，督促有关单位落实道路交通安全责任制，及时消除安全隐患。\n'),(4,'第四条  县级以上人民政府公安机关交通管理部门负责本行政区域内的道路交通安全管理工作。\n安全生产监督管理部门应当协调、监督有关部门落实道路交通安全工作措施和责任，组织有关部门开展道路交通安全专项检查。\n新闻、出版、广播、电视等有关单位应当开展道路交通安全宣传教育，发布交通安全公益广告，及时公布有关道路交通安全管理信息。\n教育行政管理部门、学校应当将道路交通安全知识纳入法制教育内容，义务教育阶段每学期安排道路交通安全主题教育不少于二课时；不得组织学生在公路或者城市道路上进行体育活动。\n交通、建设、规划、财政、农机、工商、卫生、监察、质量技术监督、司法行政、保险监督等部门应当在各自职责范围内做好有关道路交通安全工作。\n'),(5,'第五条  机关、企事业单位、社会团体以及其他组织，应当加强本单位的道路交通安全管理工作，并遵守下列规定：\n（一）建立健全本单位道路交通安全管理制度，确定一名负责人组织实施；\n（二）教育本单位驾驶人遵守道路交通安全法律、法规并进行考核；\n（三）做好机动车维护、保养和安全检查工作，保持车辆安全技术状况良好，及时消除安全隐患。\n'),(6,'第六条  公安机关交通管理部门应当严格依法履行职责，简化办事程序，提高服务质量；加强交通警察队伍管理和警风警纪建设，确保执法公正、严格、文明、高效；严格执行回避制度和罚缴分离制度；自觉接受社会和公民的监督。\n各级人民政府及其公安、财政等部门不得给公安机关交通管理部门下达或者变相下达罚款指标；公安机关交通管理部门不得以罚款数额作为考核交通警察的标准。\n'),(7,'第七条  机动车经依法登记，取得机动车登记证书、号牌和行驶证后，方可上道路行驶。\n尚未登记的机动车需要临时上道路行驶的，应当申请临时通行号牌。临时通行号牌申请以两次为限，每次使用期限不超过三十日。\n少量小型轿车号牌可以有偿发放，所得款项全部纳入道路交通事故社会救助基金，实行预算管理，具体办法由省人民政府制定。\n'),(8,'第八条  上道路行驶的机动车应当符合下列规定：\n（一）在机动车前后的规定位置各安装一面号牌，不得倒置或者反向安装；不得安装伪造、变造的号牌；\n（二）汽车配备有效的灭火器具、反光的故障车警告标志；\n（三）大中型营运载客汽车、重中型载货汽车及其挂车的车身或者车厢后部喷涂该车号牌号码二点五倍的放大牌号，放大牌号使用反光材料，喷涂的字体与号牌号码字体一致。\n'),(9,'第九条  教练车应当符合机动车安全技术标准，并具有公安机关交通管理部门核发的教练车号牌和行驶证。\n机动车驾驶培训的教练员，应当持有省机动车驾驶培训主管部门核发的教练员证，并向省公安机关交通管理部门备案。\n'),(10,'第十条  机动车驾驶人因身体条件发生变化不再符合原准驾车型条件的,应当到原驾驶证核发机关办理驾驶证注销手续，或者申请变更为符合其身体条件的准驾车型；原驾驶证核发机关可以凭县级以上医疗机构的诊断证明，注销其驾驶证或者变更其驾驶证的准驾车型，并通知机动车驾驶人办理有关手续。\n'),(11,'第十一条  实行机动车驾驶人安全信息记录制度。公安机关交通管理部门应当准确记录机动车驾驶人交通安全违法行为、累积记分和发生交通事故等信息，并通过互联网、新闻媒体或者其他途径向社会发布，为机动车所有人或者驾驶人无偿查询交通安全记录提供方便。\n公安机关交通管理部门及其交通警察发现机动车有未处理的违法行为记录的，应当按照车辆管理档案中记录的联系方式及时告知机动车所有人。\n'),(12,'第十二条  报废机动车回收企业对报废的大型客、货车及其他营运车辆进行解体的，应当在报废解体前二日报告公安机关交通管理部门，公安机关交通管理部门应当进行现场监督。\n'),(13,'第十三条  电动自行车、残疾人机动轮椅车等安装有动力装置的非机动车，必须经登记后方可上道路行驶。\n申请非机动车登记的，应当提交车辆来历证明、整车出厂合格证明、所有人身份证明。\n公安机关交通管理部门经审核认为符合发证条件的，应当及时发给登记证书、号牌。\n'),(14,'第十四条  属于登记范围内的非机动车的牌证灭失、丢失或者毁损后，非机动车所有人交验本人身份证明和车辆，到原登记机关申请补领。\n'),(15,'第十五条  公安机关交通管理部门、交通、建设行政管理部门应当按照职责分工，根据国家有关技术标准和规范，设置交通标志、标线、信号灯等交通安全设施；交通、建设行政管理部门应当督促道路管理单位加强道路养护，保障道路处于良好的技术状态；交通行政管理部门应当加强对运输企业和客运场（站）的道路交通安全监督检查。\n有关行政管理部门应当加强对交通事故多发路段的整治，完善道路交通安全设施。\n新建、改建、扩建道路，应当按照国家标准同步设计、同步建设道路交通安全设施，未经验收或者验收不合格的，不得交付使用。\n'),(16,'第十六条  道路沿线的机动车出入口应当按照道路交通安全、畅通的要求设置在交通流量相对较小的路段，并设置让行的交通标志、标线。\n在城市道路两侧增设或者封闭平面交叉口、机动车通道、机动车出入口的，应当征得建设部门和公安机关交通管理部门同意。\n'),(17,'第十七条  建设、规划部门在审批城市道路沿线的大型建筑以及其他可能影响交通安全的建设项目前，应当由公安机关交通管理部门签署意见。\n经营管理单位改变城市大型建筑的用途，从事商业、会展、娱乐、体育、餐饮、教育培训等活动，可能影响道路交通安全畅通的，应当在改变用途前报公安机关交通管理部门备案。\n'),(18,'第十八条  城市市区、县（市）城区公共停车场（库）、公交场（站）的建设应当纳入城市规划，并与城市建设同步进行。\n机关、团体、企事业单位应当按照规划和标准建设停车场（库），配建的停车场（库）应当与主体工程同时投入使用，不得擅自停用或者改作他用。\n'),(19,'第十九条  需要利用城市公共场地作为临时停车场地的，由所在地市人民政府公安机关交通管理部门负责审批并监督管理。\n'),(20,'第二十条  公安机关交通管理部门在不影响行人、车辆通行的情况下，可以根据交通状况在城市道路范围内施划停车泊位。\n因紧急情况或者举办大型活动，公安机关交通管理部门可以在道路范围内确定临时停车区，或者暂停道路停车泊位的使用。\n其他任何组织和个人不得设置、撤除停车泊位，或者在停车泊位设置障碍。\n'),(21,'第二十一条  车辆进出道路，应当减速或者停车瞭望，让在道路内正常行驶的车辆、行人优先通行。在允许机动车进出非机动车道、人行道的路段，机动车进出时不得妨碍非机动车、行人正常通行。\n'),(22,'第二十二条  车辆变更车道不得影响其他车辆、行人正常通行，并应当遵守下列规定：\n（一）让所借车道内行驶的车辆或行人先行；\n（二）按顺序依次行驶，不得频繁变更机动车道；\n（三）不得一次连续变更二条以上机动车道；\n（四）从左右两侧车道向同一车道变更时，左侧车道的车辆让右侧车道的车辆先行。\n'),(23,'第二十三条  同方向划有二条以上机动车道且没有限速标志、标线的，城市道路最高时速为七十公里，封闭的机动车专用道路和公路最高时速为九十公里。\n'),(24,'第二十四条  驾驶机动车时不得有使用耳机、耳塞收听广播以及查阅通讯信息等妨碍安全驾驶的行为；不得使用干扰交通技术监控设备的装置；按规定安装行驶记录仪的，不得更改、毁损行驶记录仪的资料。\n'),(25,'第二十五条  机动车在道路空闲、视线良好的情况下，应当在规定时速内快速连续行驶，不得妨碍后车通行。\n有交通信号灯控制的交叉路口，先于本放行信号放行的车辆仍在路口的，应当让其先行。\n会车时因相向车辆灯光照射引起视觉障碍，无法正确判明前方情况时，应当降低车速安全行驶。\n机动车遇非机动车、行人在道路上通行时，应当避让。\n'),(26,'第二十六条  机动车转弯、变更车道、超车、掉头、靠路边停车时，应当提前一百米至五十米开启转向灯。\n机动车掉头或者左转弯时应当提前进入导向车道或者在距掉头、左转弯地点一百五十米至五十米处驶入最左侧车道，并不得妨碍其他车辆和行人正常通行。\n'),(27,'第二十七条  机动车在道路上停放应当遵守下列规定：\n（一）在划有停车泊位的路段，应当在停车泊位内停放，车身不得超出停车泊位；\n（二）进出停车场或者道路停车泊位不得故意妨碍其他车辆或者行人正常通行。'),(28,'第二十八条  机动车在道路上临时停车的，应当遵守下列规定：\n（一）按顺行方向停靠，车身右侧距道路边缘不得超过三十厘米；\n（二）夜间开启危险报警闪光灯，遇风、雨、雪、雾等低能见度气象条件时，还应当同时开启示廓灯、后位灯；\n（三）在设有出租汽车停靠点的道路上，出租汽车应当在停靠点靠右侧路边按顺序停车上下乘客，但不得待客；在没有设置出租汽车停靠点的道路上，出租汽车应当遵守机动车临时停车的规定；\n（四）公共汽车进出停靠站应当在停靠站一侧按顺序依次单排靠边停车，暂时不能进入停靠站的，在最右侧机动车道单排等候进站，不得在停靠站内待客。\n'),(29,'第二十九条  驾驶非机动车应当遵守下列规定：\n（一）在没有划分非机动车道的道路上，自行车、电动自行车在距右侧道路边缘不超过一点五米的范围内通行，其他非机动车在距道路边缘不超过二点二米的范围内通行，畜力车在距道路边缘不超过二点六米的范围内通行；\n（二）通过有交通信号灯控制的交叉路口，遇有放行信号时，让先于本放行信号放行的车辆、行人先行；\n（三）与相邻行驶的非机动车保持安全距离，在与行人混行的道路上避让行人；\n（四）行经人行横道时避让行人；\n（五）设有转向灯的，转弯前开启转向灯；\n（六）制动器失效的，下车推行；\n（七）最高时速不得超过十五公里；\n（八）自行车、电动自行车可以搭乘一名十二岁以下儿童，搭乘六岁以下儿童应当使用安全座椅；\n（九）未成年人驾驶自行车、电动自行车不得载人。\n'),(30,'第三十条  行人在道路上应当遵守下列规定：\n（一）在没有划分人行道的道路上，行人在距离道路边缘线一米范围内通行；\n（二）不得进入高速公路或者其他封闭的机动车专用道；\n（三）不得在车行道上等候车辆或者招引营运车辆；\n（四）不得在道路上发放商品广告、兜售物品及进行其他推销行为；\n（五）不得在道路上以乞讨、引路、提供食宿服务等为目的招引、拦截车辆；\n（六）赶骑牲畜不得影响车辆正常通行。\n'),(31,'第三十一条  乘车人应当遵守下列规定：\n（一）机动车未停稳时不得上下车；\n（二）不得从车窗上下车；\n（三）下车时不得影响其他车辆和行人正常通行。\n'),(32,'第三十二条  遇自然灾害、恶劣气象条件或者发生重大交通事故等严重影响交通安全的情形，公安机关交通管理部门可以采取限制车速、调换车道、暂时中断通行、关闭高速公路等交通管制措施。所采取的交通管制措施需高速公路管理机构配合的，公安机关交通管理部门应当及时通报高速公路管理机构，高速公路管理机构应当予以配合。\n关闭高速公路的，公安机关交通管理部门应当严格按照相应条件执行，确保所采取的措施科学、合理，并应当组织警力疏导交通，及时恢复交通秩序。\n关闭高速公路的条件由省公安机关交通管理部门会同省高速公路管理机构制定。\n'),(33,'第三十三条  机动车从停车港湾驶入行车道时，应当先开启左转向灯，在路肩或者应急车道上将车速提高到每小时六十公里以上，并不得妨碍行车道内车辆正常行驶。\n机动车发生故障后，驾驶人应当迅速将机动车移至右侧路肩或者应急道内自行修理；不能移动的，应当迅速报警；事故车辆由救援车、清障车拖曳、牵引。禁止任何单位和个人在高速公路提供修车服务。\n禁止营运车辆在高速公路上上下乘客。\n'),(34,'第三十四条  机动车遇前方车辆停车排队等候或者缓慢行驶时，不得占用应急车道或者右侧路肩超车、停车，本车道最末车辆应当开启危险报警闪光灯。\n发生交通事故后，警告标志应当设置在事故车辆来车方向一百五十米以外。\n'),(35,'第三十五条  在进行救援、清障作业时，作业单位应当自作业现场来车方向一百五十米起用反光锥筒等醒目警示标志划定作业区域，并参照道路施工作业的相关标准采取安全措施。\n道路施工作业完毕后，施工作业单位应当及时清理施工现场，并及时报告公安机关交通管理部门和高速公路管理机构，经验收合格后，逆车流方向拆除警示标志。\n'),(36,'第三十六条  公安机关交通管理部门在处理交通事故时，根据需要可以扣留交通事故当事人的机动车驾驶证，并出具凭证；除依法给予暂扣或者吊销机动车驾驶证的处罚外，应当在十日内返还。\n因处理交通事故需要检验、鉴定、评估，属公安机关交通管理部门职责的，不得向当事人收取费用；确需由社会中介机构实施的，其费用由事故当事人按照过错大小承担。\n'),(37,'第三十七条  发生交通事故的，交通警察应当对交通事故现场进行勘验、检查，收集证据；因收集证据的需要，可以扣押事故车辆，但是应当妥善保管，以备核查。\n发生交通事故造成人员伤亡、财产损失不能及时了结的，有赔偿责任的当事人或者事故车辆所有人应当提供有效担保。\n'),(38,'第三十八条  机动车与非机动车驾驶人、行人之间发生交通事故，造成人身伤亡、财产损失的，由保险公司在机动车第三者责任强制保险责任限额范围内予以赔偿。超过责任限额的部分，由机动车一方承担责任；但是，有证据证明非机动车驾驶人、行人违反道路交通安全法律、法规，机动车驾驶人已经采取必要处置措施的，机动车一方按照以下规定承担赔偿责任：\n（一）机动车一方负主要责任的，承担百分之八十；\n（二）机动车一方负同等责任的，承担百分之六十；\n（三）机动车一方负次要责任的，承担百分之四十；\n（四）机动车一方无责任的，承担百分之十以下；\n（五）道路交通事故发生在高速公路上的，机动车一方承担百分之五至百分之十的赔偿责任，但赔偿金额最高不超过一万元。\n未参加机动车第三者责任强制保险的，由机动车一方在该车应当投保的最低保险责任限额内予以赔偿，对超过最低保险责任限额的部分，按照前款的规定赔偿。\n非机动车驾驶人、行人故意追求交通事故的发生而造成损失的，机动车一方不承担赔偿责任。\n非机动车驾驶人、行人与处于静止状态的机动车发生交通事故，机动车一方无交通事故责任的，不承担赔偿责任。\n'),(39,'第三十九条  对违反道路交通安全法律、法规的行为，由公安机关交通管理部门责令改正，依照《道路交通安全法》、《实施条例》的规定予以处罚。给予罚款处罚的，罚款数额按照本办法规定的具体标准执行，法律、行政法规另有规定的，从其规定。\n公安机关交通管理部门及其交通警察，对情节轻微、未影响道路通行的道路交通安全违法行为者，应当坚持教育为主的原则，给予口头警告后放行。\n'),(40,'第四十条  行人、乘车人违反法律、法规关于道路通行规定的，视情节处十元以上二十元以下罚款。\n非机动车驾驶人违反法律、法规关于道路通行规定的，视情节处二十元以上五十元以下罚款。\n'),(41,'第四十一条  驾驶机动车有下列行为之一的，处五十元罚款：\n（一）未携带行驶证、驾驶证的；\n（二）未按照规定使用安全带的；\n（三）驾驶摩托车未按照规定使用安全头盔的；\n（四）行车时车门、车厢未关好的；\n（五）进出停车场或者道路停车泊位故意妨碍其他车辆或者行人正常通行的。\n'),(42,'第四十二条  驾驶机动车有下列情形之一的，处一百元罚款：\n（一）驾驶摩托车手离车把或者在车把上悬挂物品的；\n（二）更改、毁损行驶记录仪记录资料的；\n（三）使用干扰交通技术监控设备装置的；\n（四）不按规定在道路中间行驶的；\n（五）违反分道行驶规定的；\n（六）不按照交通标志、标线指示行驶的；\n（七）违反限制通行规定的；\n（八）不按照规定与前车保持安全距离的；\n（九）违反规定倒车的；\n（十）违反规定牵引挂车的；\n（十一）违反交替通行规定的；\n（十二）违反灯光使用规定的；\n（十三）违反故障机动车牵引规定的；\n（十四）向道路上抛撒物品的；\n（十五）违反规定使用喇叭的；\n（十六）机动车发生故障，不按照规定报警的；\n（十七）违反规定停放车辆或者临时停车，机动车驾驶人不在现场或者虽在现场但拒绝立即驶离，妨碍其他车辆、行人通行的；\n（十八）行经交叉路口、环形路口、道路出入口或者进出、穿越道路不按照规定行车、停车或者让行的；\n（十九）通过无交通信号控制路口不减速让行的；\n（二十）通过无交通信号或者无管理人员的铁路道口不减速或者不停车确认安全的；\n（二十一）行经无交通信号的道路，遇行人横过道路不按照规定避让的。\n'),(43,'第四十三条  机动车载人、载物有下列情形之一的，处一百元罚款：\n（一）非公路客运车辆载人超过核定人数但不足百分之二十的；\n（二）驾驶摩托车、拖拉机违反规定载人的；\n（三）载客汽车违反规定载货的；\n（四）载物违反装载要求的。\n'),(44,'第四十四条  驾驶机动车有下列情形之一的，处二百元罚款：\n（一）驾驶安全设施不全或者机件不符合技术标准等具有安全隐患的机动车上道路行驶的；\n（二）服用国家管制的精神药品或者麻醉药品影响安全驾驶仍驾驶机动车的；\n（三）患有妨碍安全驾驶机动车的疾病驾驶机动车的；\n（四）安装号牌违反规定的；\n（五）故意遮挡或者污损机动车号牌的；\n（六）改变车身颜色、更换发动机、更换车身或者车架，未办理变更登记的；\n（七）客运车辆、重中型载货汽车及其挂车未按规定喷涂放大的牌号、放大牌号不清晰的；\n（八）未悬挂机动车号牌或者未放置临时号牌的；\n（九）未按照规定放置检验合格标志、保险标志的；\n（十）未依法进行注册登记、未取得临时号牌以及未按规定进行安全技术检验上道路行驶的。\n'),(45,'第四十五条  驾驶机动车有下列行为之一的，处二百元罚款：\n（一）逆向行驶的；\n（二）违反规定在专用车道内行驶的；\n（三）在划设公交专用车道的道路上，公共汽车违反规定在其他车道内通行的；\n（四）违反交通信号灯指示或者交通警察指挥行驶的；\n（五）违反规定超车的；\n（六）违反规定变更车道的；\n（七）违反规定会车的；\n（八）违反规定掉头的；\n（九）行经人行横道遇行人通过时，未停车让行的；\n（十）非公路客运车辆载人超过核定人数百分之二十以上的；\n（十一）货运机动车违反规定附载作业人员的；\n（十二）运载危险化学品未按照规定行驶的；\n（十三）通过铁路道口，违反交通信号或者管理人员指挥的；\n（十四）载运超限物品行经铁路道口，未按照当地铁路部门指定的铁路道口、时间通过的；\n（十五）遇有执行紧急任务的警车、消防车、救护车、工程救险车未按照规定让行的。\n'),(46,'第四十六条  驾驶机动车有下列情形之一的，处二百元罚款：\n（一）拨打、接听电话、观看电视的；\n（二）使用耳机、耳塞收听广播，查阅通讯信息的；\n（三）下陡坡时熄火或者空档滑行的；\n（四）连续驾驶超过四个小时，未停车休息或者停车休息时间少于二十分钟的；\n（五）警车、消防车、救护车、工程救险车违反规定使用警报器、标志灯具的；\n（六）出租汽车违反规定在道路上停车待客的；\n（七）公共汽车违反规定停车上下乘客、违反规定驶入停靠站及在停靠站待客的。\n'),(47,'第四十七条  遇前方道路受阻或者前方车辆排队等候、缓慢行驶时，驾驶机动车有下列情形之一的，处二百元罚款：\n（一）违反规定进入路口的；\n（二）违反规定在人行横道或者网状线区域内停车等候的；\n（三）借道超车的；\n（四）占用对面车道的；\n（五）穿插等候车辆的；\n（六）进入非机动车道、人行道行驶的。\n'),(48,'第四十八条  驾驶机动车发生故障或者事故，有下列情形之一的，处二百元罚款：\n（一）不按照规定开启危险报警闪光灯的；\n（二）不按照规定设置警告标志的；\n（三）夜间不开启示廓灯和后位灯的；\n（四）机动车发生故障后尚能移动，不移至不妨碍交通地点的。\n'),(49,'第四十九条  在道路上学习驾驶未按照指定路线、时间进行或者教练车乘坐无关人员的，对教练员处二百元罚款。\n在实习期内驾驶禁止驾驶的机动车或者未按照规定在车身后部粘贴或者悬挂统一式样的实习标志的，对驾驶人处二百元罚款。\n'),(50,'第五十条  机动车在高速公路通行，有下列行为之一的，处二百元罚款：\n（一）驾驶禁止驶入的机动车进入的；\n（二）行驶速度低于规定最低时速的；\n（三）未按照规定保持行车间距的；\n（四）低能见度气象条件下未按照规定行驶的；\n（五）倒车、逆行、穿越中央分隔带掉头或者在车行道内停车的；\n（六）在匝道、加速车道或者减速车道上超车的；\n（七）骑、轧车行道分界线的；\n（八）非紧急情况下在应急车道或路肩行驶或停车的；\n（九）营运车辆在高速公路上上下乘客的；\n（十）发生故障后不迅速报警的；\n（十一）试车或者学习驾驶机动车的；\n（十二）货运机动车车厢内载人的；\n（十三）非救援车、清障车拖曳、牵引机动车的；\n（十四）救援车、清障车执行救援、清障任务时，未开启示警灯和危险报警闪光灯的。\n'),(51,'第五十一条  机动车驾驶证被暂扣期间驾驶机动车的，处五百元罚款；属营运载客汽车的，处一千元罚款；属摩托车的，处二百元罚款。\n机动车驾驶证被吊销后驾驶机动车的，处八百元罚款；属营运载客汽车的，处一千五百元罚款；属摩托车的，处二百元以上四百元以下罚款。\n未取得机动车驾驶证驾驶机动车的，处一千元罚款；属营运载客汽车的，处二千元罚款；属摩托车的，处二百元以上五百元以下罚款。\n将机动车交由未取得机动车驾驶证或者机动车驾驶证被暂扣、被吊销的人驾驶的，分别按照前款规定处罚。\n'),(52,'第五十二条  运输单位的车辆有《道路交通安全法》第九十二条第一款、第二款规定的情形之一，经处罚不改的，对直接负责的主管人员处二千元罚款；经两次以上处罚不改的，对直接负责的主管人员处五千元罚款。\n'),(53,'第五十三条  有下列行为之一的，处五百元以上二千元以下罚款：\n（一）伪造、变造或者使用伪造、变造的机动车登记证书、行驶证、号牌、检验合格标志、保险标志、驾驶证的；\n（二）使用其他车辆的机动车登记证书、行驶证、号牌、检验合格标志、保险标志的；\n（三）非法安装警报器、标志灯具的；\n（四）造成交通事故后逃逸，尚不构成犯罪的；\n（五）强迫机动车驾驶人违反道路交通安全法律、法规和机动车安全驾驶要求驾驶机动车，造成交通事故，尚不构成犯罪的；\n（六）违反交通管制的规定强行通行，不听劝阻的；\n（七）故意毁损、移动、涂改交通设施，造成危害后果，尚不构成犯罪的；\n（八）非法拦截、扣留机动车辆，不听劝阻，造成严重交通阻塞或者较大财产损失的；\n（九）驾驶拼装或者已达到报废标准的机动车上道路行驶的；\n（十）在道路两侧以及隔离带上种植树木、其他植物或者设置广告牌、管线等，遮挡路灯、交通信号灯、交通标志，妨碍安全视距，拒不按照公安机关交通管理部门的要求排除妨碍的。\n'),(54,'第五十四条  擅自在城市道路两侧增设或者封闭平面交叉口、机动车通道、机动车出入口的，由公安机关交通管理部门责令限期改正；拒不改正的，强制恢复原状，所需费用由行为人承担。\n'),(55,'第五十五条 向社会提供服务的单位将按照规划建设的停车场（库）擅自停用或者改作他用，致使有关车辆停放影响道路交通安全的，由公安机关交通管理部门责令有关单位限期改正；拒不改正的，由公安机关交通管理部门提请人民政府依法处理。\n'),(56,'第五十六条  被处罚人逾期不交纳罚款的，由公安机关交通管理部门按照《道路交通安全法》的规定每日按罚款数额百分之三加处罚款，但是加处罚款的总额不得超过原罚款本数。\n'),(57,'第五十七条  公安、交通、建设等有关职能部门或者其他单位的工作人员在道路交通安全管理工作中有下列情形之一的，对直接负责的主管人员和其他直接责任人员依法给予处分：\n（一）违反规定的条件、程序作出审批决定或者发放牌证、许可证的；\n（二）没有按照规定实施安全检查的；\n（三）对违法行为只处罚不纠正的；\n（四）新建、改建、扩建道路，未按照国家标准同步设计、同步建设交通安全设施或者未经验收或者验收不合格交付使用的；\n（五）贯彻执行道路交通安全管理法律、法规和交通安全责任制工作不力，造成严重后果的；\n（六）对存在的交通安全隐患，没有及时报告或者未及时整改或者整改不力的；\n（七）接到发生交通事故的报告后不及时出警，或者因处置不当、组织抢救不及时，导致事故后果扩大的；\n（八）发生重特大交通事故后，未按照规定的程序和时限上报，或者故意隐瞒不报、拖延报告的；\n（九）阻碍、干涉交通事故调查处理或者提供虚假证明的；\n（十）其他不按照规定履行职责或者失职、渎职的行为。\n'),(58,'第五十八条  农业机械主管部门对上路行驶的拖拉机按照本办法第七条第一款、第二款和第九条的规定行使公安机关交通管理部门的相应职权，承担相应责任。\n'),(59,'第五十九条  本办法自2006年9月1日起施行。');
/*!40000 ALTER TABLE `wp_law_banfa` ENABLE KEYS */;

