/*!40000 ALTER TABLE `wp_law_jiashizhengguiding` DISABLE KEYS */;
INSERT INTO `wp_law_jiashizhengguiding` VALUES (1,'第一条根据《中华人民共和国道路交通安全法》及其实施条例、《中华人民共和国行政许可法》，制定本规定。\n'),(2,'第二条本规定由公安机关交通管理部门负责实施。\n省级公安机关交通管理部门负责本省（自治区、直辖市）机动车驾驶证业务工作的指导、检查和监督。直辖市公安机关交通管理部门车辆管理所、设区的市或者相当于同级的公安机关交通管理部门车辆管理所负责办理本行政辖区内机动车驾驶证业务。\n县级公安机关交通管理部门车辆管理所可以办理本行政辖区内低速载货汽车、三轮汽车、摩托车驾驶证业务，以及其他机动车驾驶证换发、补发、审验、提交身体条件证明等业务。条件具备的，可以办理小型汽车、小型自动挡汽车、残疾人专用小型自动挡载客汽车驾驶证业务，以及其他机动车驾驶证的道路交通安全法律、法规和相关知识考试业务。具体业务范围和办理条件由省级公安机关交通管理部门确定。\n'),(3,'第三条 车辆管理所办理机动车驾驶证业务，应当遵循严格、公开、公正、便民的原则。\n车辆管理所办理机动车驾驶证业务，应当依法受理申请人的申请，审核申请人提交的材料。对符合条件的，按照规定的标准、程序和期限办理机动车驾驶证。对申请材料不齐全或者不符合法定形式的，应当一次书面告知申请人需要补正的全部内容。对不符合条件的，应当书面告知理由。\n车辆管理所应当将法律、行政法规和本规定的有关办理机动车驾驶证的事项、条件、依据、程序、期限以及收费标准、需要提交的全部材料的目录和申请表示范文本等在办公场所公示。\n省级、设区的市或者相当于同级的公安机关交通管理部门应当在互联网上建立主页，发布信息，便于群众查阅办理机动车驾驶证的有关规定，查询驾驶证使用状态、交通违法及记分等情况，下载、使用有关表格。\n　　'),(4,'第四条 申请办理机动车驾驶证业务的人，应当如实向车辆管理所提交规定的材料，如实申告规定的事项，并对其申请材料实质内容的真实性负责。\n　　'),(5,'第五条 公安机关交通管理部门应当建立对车辆管理所办理机动车驾驶证业务的监督制度，加强对驾驶人考试、驾驶证核发和使用的监督管理。\n　　'),(6,'第六条 车辆管理所应当使用机动车驾驶证计算机管理系统核发、打印机动车驾驶证，不使用计算机管理系统核发、打印的机动车驾驶证无效。\n　　机动车驾驶证计算机管理系统的数据库标准和软件全国统一，能够完整、准确地记录和存储申请受理、科目考试、机动车驾驶证核发等全过程和经办人员信息，并能够实时将有关信息传送到全国公安交通管理信息系统。\n　　'),(7,'第七条 车辆管理所应当使用互联网交通安全综合服务管理平台，按规定办理机动车驾驶证业务。\n　　互联网交通安全综合服务管理平台信息管理系统数据库标准和软件全国统一。\n　　申请人使用互联网交通安全综合服务管理平台办理机动车驾驶证业务的，经过身份验证后，可以通过网上提交申请。\n　　'),(8,'第八条 驾驶机动车，应当依法取得机动车驾驶证。\n　　'),(9,'第九条 机动车驾驶人准予驾驶的车型顺序依次分为：大型客车、牵引车、城市公交车、中型客车、大型货车、小型汽车、小型自动挡汽车、低速载货汽车、三轮汽车、残疾人专用小型自动挡载客汽车、普通三轮摩托车、普通二轮摩托车、轻便摩托车、轮式自行机械车、无轨电车和有轨电车（附件1）。\n　　'),(10,'第十条 机动车驾驶证记载和签注以下内容：\n　　（一）机动车驾驶人信息：姓名、性别、出生日期、国籍、住址、身份证明号码（机动车驾驶证号码）、照片；\n　　（二）车辆管理所签注内容：初次领证日期、准驾车型代号、有效期限、核发机关印章、档案编号。\n　　'),(11,'第十一条 机动车驾驶证有效期分为六年、十年和长期。\n\n　　'),(12,'第十二条 申请机动车驾驶证的人，应当符合下列规定：\n　　（一）年龄条件：\n　　1、申请小型汽车、小型自动挡汽车、残疾人专用小型自动挡载客汽车、轻便摩托车准驾车型的，在18周岁以上、70周岁以下；\n　　2、申请低速载货汽车、三轮汽车、普通三轮摩托车、普通二轮摩托车或者轮式自行机械车准驾车型的，在18周岁以上，60周岁以下；\n　　3、申请城市公交车、大型货车、无轨电车或者有轨电车准驾车型的，在20周岁以上，50周岁以下；\n　　4、申请中型客车准驾车型的，在21周岁以上，50周岁以下；\n　　5、申请牵引车准驾车型的，在24周岁以上，50周岁以下；\n　　6、申请大型客车准驾车型的，在26周岁以上，50周岁以下；\n　　7、接受全日制驾驶职业教育的学生，申请大型客车、牵引车准驾车型的，在20周岁以上，50周岁以下。\n　　（二）身体条件：\n　　1、身高：申请大型客车、牵引车、城市公交车、大型货车、无轨电车准驾车型的，身高为155厘米以上。申请中型客车准驾车型的，身高为150厘米以上；\n　　2、视力：申请大型客车、牵引车、城市公交车、中型客车、大型货车、无轨电车或者有轨电车准驾车型的，两眼裸视力或者矫正视力达到对数视力表5.0以上。申请其他准驾车型的，两眼裸视力或者矫正视力达到对数视力表4.9以上。单眼视力障碍，优眼裸视力或者矫正视力达到对数视力表5.0以上，且水平视野达到150度的，可以申请小型汽车、小型自动挡汽车、低速载货汽车、三轮汽车、残疾人专用小型自动挡载客汽车准驾车型的机动车驾驶证；\n　　3、辨色力：无红绿色盲；\n　　4、听力：两耳分别距音叉50厘米能辨别声源方向。有听力障碍但佩戴助听设备能够达到以上条件的，可以申请小型汽车、小型自动挡汽车准驾车型的机动车驾驶证；\n　　5、上肢：双手拇指健全，每只手其他手指必须有三指健全，肢体和手指运动功能正常。但手指末节残缺或者左手有三指健全，且双手手掌完整的，可以申请小型汽车、小型自动挡汽车、低速载货汽车、三轮汽车准驾车型的机动车驾驶证；\n　　6、下肢：双下肢健全且运动功能正常，不等长度不得大于5厘米。但左下肢缺失或者丧失运动功能的，可以申请小型自动挡汽车准驾车型的机动车驾驶证；\n　　7、躯干、颈部：无运动功能障碍；\n　　8、右下肢、双下肢缺失或者丧失运动功能但能够自主坐立，且上肢符合本项第5目规定的，可以申请残疾人专用小型自动挡载客汽车准驾车型的机动车驾驶证。一只手掌缺失，另一只手拇指健全，其他手指有两指健全，上肢和手指运动功能正常，且下肢符合本项第6目规定的，可以申请残疾人专用小型自动挡载客汽车准驾车型的机动车驾驶证。\n　　'),(13,'第十三条 有下列情形之一的，不得申请机动车驾驶证:\n　　（一）有器质性心脏病、癫痫病、美尼尔氏症、眩晕症、癔病、震颤麻痹、精神病、痴呆以及影响肢体活动的神经系统疾病等妨碍安全驾驶疾病的；\n　　（二）三年内有吸食、注射毒品行为或者解除强制隔离戒毒措施未满三年，或者长期服用依赖性精神药品成瘾尚未戒除的；\n　　（三）造成交通事故后逃逸构成犯罪的；\n　　（四）饮酒后或者醉酒驾驶机动车发生重大交通事故构成犯罪的；\n　　（五）醉酒驾驶机动车或者饮酒后驾驶营运机动车依法被吊销机动车驾驶证未满五年的；\n　　（六）醉酒驾驶营运机动车依法被吊销机动车驾驶证未满十年的；\n　　（七）因其他情形依法被吊销机动车驾驶证未满二年的；\n　　（八）驾驶许可依法被撤销未满三年的；\n　　（九）法律、行政法规规定的其他情形。\n　　未取得机动车驾驶证驾驶机动车，有第一款第五项至第七项行为之一的，在规定期限内不得申请机动车驾驶证。\n　　'),(14,'第十四条 初次申领机动车驾驶证的，可以申请准驾车型为城市公交车、大型货车、小型汽车、小型自动挡汽车、低速载货汽车、三轮汽车、残疾人专用小型自动挡载客汽车、普通三轮摩托车、普通二轮摩托车、轻便摩托车、轮式自行机械车、无轨电车、有轨电车的机动车驾驶证。\n　　已持有机动车驾驶证，申请增加准驾车型的，可以申请增加的准驾车型为大型客车、牵引车、城市公交车、中型客车、大型货车、小型汽车、小型自动挡汽车、低速载货汽车、三轮汽车、普通三轮摩托车、普通二轮摩托车、轻便摩托车、轮式自行机械车、无轨电车、有轨电车。\n　　'),(15,'第十五条 已持有机动车驾驶证，申请增加准驾车型的，应当在本记分周期和申请前最近一个记分周期内没有记满12分记录。申请增加中型客车、牵引车、大型客车准驾车型的，还应当符合下列规定：\n　　（一）申请增加中型客车准驾车型的，已取得驾驶城市公交车、大型货车、小型汽车、小型自动挡汽车、低速载货汽车或者三轮汽车准驾车型资格三年以上，并在申请前最近连续三个记分周期内没有记满12分记录；\n　　（二）申请增加牵引车准驾车型的，已取得驾驶中型客车或者大型货车准驾车型资格三年以上，或者取得驾驶大型客车准驾车型资格一年以上，并在申请前最近连续三个记分周期内没有记满12分记录；\n　　（三）申请增加大型客车准驾车型的，已取得驾驶城市公交车、中型客车或者大型货车准驾车型资格五年以上，或者取得驾驶牵引车准驾车型资格二年以上，并在申请前最近连续五个记分周期内没有记满12分记录。\n　　正在接受全日制驾驶职业教育的学生，已在校取得驾驶小型汽车准驾车型资格，并在本记分周期和申请前最近一个记分周期内没有记满12分记录的，可以申请增加大型客车、牵引车准驾车型。\n　　'),(16,'第十六条 有下列情形之一的，不得申请大型客车、牵引车、城市公交车、中型客车、大型货车准驾车型：\n　　（一）发生交通事故造成人员死亡，承担同等以上责任的；\n　　（二）醉酒后驾驶机动车的；\n　　（三）被吊销或者撤销机动车驾驶证未满十年的。\n　　'),(17,'第十七条 持有军队、武装警察部队机动车驾驶证，或者持有境外机动车驾驶证，符合本规定的申请条件，可以申请相应准驾车型的机动车驾驶证。\n　　'),(18,'第十八条 申领机动车驾驶证的人，按照下列规定向车辆管理所提出申请：\n　　（一）在户籍所在地居住的，应当在户籍所在地提出申请；\n　　（二）在户籍所在地以外居住的，可以在居住地提出申请；\n　　（三）现役军人（含武警），应当在居住地提出申请；\n　　（四）境外人员，应当在居留地或者居住地提出申请；\n　　（五）申请增加准驾车型的，应当在所持机动车驾驶证核发地提出申请；\n　　（六）接受全日制驾驶职业教育，申请增加大型客车、牵引车准驾车型的，应当在接受教育地提出申请。\n　　'),(19,'第十九条 初次申请机动车驾驶证，应当填写申请表，并提交以下证明：\n　　（一）申请人的身份证明；\n　　（二）县级或者部队团级以上医疗机构出具的有关身体条件的证明。属于申请残疾人专用小型自动挡载客汽车的，应当提交经省级卫生主管部门指定的专门医疗机构出具的有关身体条件的证明。\n　　'),(20,'第二十条 申请增加准驾车型的，应当填写申请表，提交第十九条规定的证明和所持机动车驾驶证。属于接受全日制驾驶职业教育，申请增加大型客车、牵引车准驾车型的，还应当提交学校出具的学籍证明。\n　　'),(21,'第二十一条 持军队、武装警察部队机动车驾驶证的人申请机动车驾驶证，应当填写申请表，并提交以下证明、凭证：\n　　（一）申请人的身份证明。属于复员、转业、退伍的人员，还应当提交军队、武装警察部队核发的复员、转业、退伍证明；\n　　（二）县级或者部队团级以上医疗机构出具的有关身体条件的证明；\n　　（三）军队、武装警察部队机动车驾驶证。\n　　'),(22,'第二十二条 持境外机动车驾驶证的人申请机动车驾驶证，应当填写申请表，并提交以下证明、凭证：\n　　（一）申请人的身份证明；\n　　（二）县级以上医疗机构出具的有关身体条件的证明。属于外国驻华使馆、领馆人员及国际组织驻华代表机构人员申请的，按照外交对等原则执行；\n　　（三）所持机动车驾驶证。属于非中文表述的，还应当出具中文翻译文本。\n　　申请人属于内地居民的，还应当提交申请人的护照或者《内地居民往来港澳通行证》、《大陆居民往来台湾通行证》。\n　　'),(23,'第二十三条 实行小型汽车、小型自动挡汽车驾驶证自学直考的地方，申请人可以使用加装安全辅助装置的自备机动车，在具备安全驾驶经历等条件的人员随车指导下，按照公安机关交通管理部门指定的路线、时间学习驾驶技能，按照第十九条或者第二十条的规定申请相应准驾车型的驾驶证。\n　　小型汽车、小型自动挡汽车驾驶证自学直考管理制度由公安部另行规定。\n　　'),(24,'第二十四条 申请机动车驾驶证的人，符合本规定要求的驾驶许可条件，具有下列情形之一的，可以按照第十四条第一款和第十九条的规定直接申请相应准驾车型的机动车驾驶证考试：\n　　（一）原机动车驾驶证因超过有效期未换证被注销的；\n　　（二）原机动车驾驶证因未提交身体条件证明被注销的；\n　　（三）原机动车驾驶证由本人申请注销的；\n　　（四）原机动车驾驶证因身体条件暂时不符合规定被注销的；\n　　（五）原机动车驾驶证因其他原因被注销的，但机动车驾驶证被吊销或者被撤销的除外；\n　　（六）持有的军队、武装警察部队机动车驾驶证超过有效期的；\n　　（七）持有的境外机动车驾驶证超过有效期的。\n　　有前款第六项、第七项规定情形之一的，还应当提交超过有效期的机动车驾驶证。\n　　'),(25,'第二十五条 申请人提交的证明、凭证齐全、符合法定形式的，车辆管理所应当受理，并按规定审核申请人的机动车驾驶证申请条件。属于第二十二条第二款规定情形的，还应当核查申请人的出入境记录；属于第二十四条第一款第一项至第五项规定情形之一的，还应当核查申请人的驾驶经历。\n　　对于符合申请条件的，车辆管理所应当按规定安排预约考试；不需要考试的，一日内核发机动车驾驶证。\n　　'),(26,'第二十六条 车辆管理所对申请人的申请条件及提交的材料、申告的事项有疑义的，可以对实质内容进行调查核实。\n　　调查时，应当询问申请人并制作询问笔录，向证明、凭证的核发机关核查。\n　　经调查，申请人不符合申请条件的，不予办理；有违法行为的，依法予以处理。\n\n　　'),(27,'第二十七条 机动车驾驶人考试内容分为道路交通安全法律、法规和相关知识考试科目（以下简称“科目一”）、场地驾驶技能考试科目（以下简称“科目二”）、道路驾驶技能和安全文明驾驶常识考试科目（以下简称“科目三”）。\n　　'),(28,'第二十八条 考试内容和合格标准全国统一，根据不同准驾车型规定相应的考试项目。\n　　'),(29,'第二十九条 科目一考试内容包括：道路通行、交通信号、交通安全违法行为和交通事故处理、机动车驾驶证申领和使用、机动车登记等规定以及其他道路交通安全法律、法规和规章。\n　　'),(30,'第三十条 科目二考试内容包括：\n　　（一）大型客车、牵引车、城市公交车、中型客车、大型货车考试桩考、坡道定点停车和起步、侧方停车、通过单边桥、曲线行驶、直角转弯、通过限宽门、通过连续障碍、起伏路行驶、窄路掉头，以及模拟高速公路、连续急弯山区路、隧道、雨（雾）天、湿滑路、紧急情况处置；\n　　（二）小型汽车、小型自动挡汽车、残疾人专用小型自动挡载客汽车和低速载货汽车考试倒车入库、坡道定点停车和起步、侧方停车、曲线行驶、直角转弯；\n　　（三）三轮汽车、普通三轮摩托车、普通二轮摩托车和轻便摩托车考试桩考、坡道定点停车和起步、通过单边桥；\n　　（四）轮式自行机械车、无轨电车、有轨电车的考试内容由省级公安机关交通管理部门确定。\n　　对第一款第一项、第二项规定的准驾车型，省级公安机关交通管理部门可以根据实际增加考试内容。\n　　'),(31,'第三十一条 科目三道路驾驶技能考试内容包括：大型客车、牵引车、城市公交车、中型客车、大型货车、小型汽车、小型自动挡汽车、低速载货汽车和残疾人专用小型自动挡载客汽车考试上车准备、起步、直线行驶、加减挡位操作、变更车道、靠边停车、直行通过路口、路口左转弯、路口右转弯、通过人行横道线、通过学校区域、通过公共汽车站、会车、超车、掉头、夜间行驶；其他准驾车型的考试内容，由省级公安机关交通管理部门确定。\n　　大型客车、中型客车考试里程不少于20公里，其中白天考试里程不少于10公里，夜间考试里程不少于5公里。牵引车、城市公交车、大型货车考试里程不少于10公里，其中白天考试里程不少于5公里，夜间考试里程不少于3公里。小型汽车、小型自动挡汽车、低速载货汽车、残疾人专用小型自动挡载客汽车考试里程不少于3公里，在白天考试时，应当进行模拟夜间灯光考试。\n　　对大型客车、牵引车、城市公交车、中型客车、大型货车，省级公安机关交通管理部门应当根据实际增加山区、隧道、陡坡等复杂道路驾驶考试内容。对其他汽车准驾车型，省级公安机关交通管理部门可以根据实际增加考试内容。\n　　'),(32,'第三十二条 科目三安全文明驾驶常识考试内容包括：安全文明驾驶操作要求、恶劣气象和复杂道路条件下的安全驾驶知识、爆胎等紧急情况下的临危处置方法以及发生交通事故后的处置知识等。\n　　'),(33,'第三十三条 持军队、武装警察部队机动车驾驶证的人申请大型客车、牵引车、城市公交车、中型客车、大型货车准驾车型机动车驾驶证的，应当考试科目一和科目三；申请其他准驾车型机动车驾驶证的，免予考试核发机动车驾驶证。\n　　'),(34,'第三十四条 持境外机动车驾驶证申请机动车驾驶证的，应当考试科目一。申请准驾车型为大型客车、牵引车、城市公交车、中型客车、大型货车机动车驾驶证的，还应当考试科目三。\n　　内地居民持有境外机动车驾驶证，取得该机动车驾驶证时在核发国家或者地区连续居留不足三个月的，应当考试科目一、科目二和科目三。\n　　属于外国驻华使馆、领馆人员及国际组织驻华代表机构人员申请的，应当按照外交对等原则执行。\n　　'),(35,'第三十五条 各科目考试的合格标准为：\n　　（一）科目一考试满分为100分，成绩达到90分的为合格；\n　　（二）科目二考试满分为100分，考试大型客车、牵引车、城市公交车、中型客车、大型货车准驾车型的，成绩达到90分的为合格，其他准驾车型的成绩达到80分的为合格；\n　　（三）科目三道路驾驶技能和安全文明驾驶常识考试满分分别为100分，成绩分别达到90分的为合格。\n　　'),(36,'第三十六条 车辆管理所应当按照预约的考场和时间安排考试。申请人科目一考试合格后，可以预约科目二或者科目三道路驾驶技能考试。有条件的地方，申请人可以同时预约科目二、科目三道路驾驶技能考试，预约成功后可以连续进行考试。科目二、科目三道路驾驶技能考试均合格后，申请人可以当日参加科目三安全文明驾驶常识考试。\n　　申请人预约科目二、科目三道路驾驶技能考试，车辆管理所在六十日内不能安排考试的，可以选择省（自治区、直辖市）内其他考场预约考试。\n　　车辆管理所应当使用全国统一的考试预约系统，采用互联网、电话、服务窗口等方式供申请人预约考试。\n　　'),(37,'第三十七条 初次申请机动车驾驶证或者申请增加准驾车型的，科目一考试合格后，车辆管理所应当在一日内核发学习驾驶证明（附件2）。\n　　属于自学直考的，车辆管理所还应当按规定发放学车专用标识（附件3）。\n　　'),(38,'第三十八条 申请人在场地和道路上学习驾驶，应当按规定取得学习驾驶证明。学习驾驶证明的有效期为三年，申请人应当在有效期内完成科目二和科目三考试。未在有效期内完成考试的，已考试合格的科目成绩作废。\n　　学习驾驶证明可以采用纸质或者电子形式，纸质学习驾驶证明和电子学习驾驶证明具有同等效力。申请人可以通过互联网交通安全综合服务管理平台打印或者下载学习驾驶证明。\n　　'),(39,'第三十九条 申请人在道路上学习驾驶，应当随身携带学习驾驶证明，使用教练车或者学车专用标识签注的自学用车，在教练员或者学车专用标识签注的指导人员随车指导下，按照公安机关交通管理部门指定的路线、时间进行。\n　　申请人为自学直考人员的，在道路上学习驾驶时，应当在自学用车上按规定放置、粘贴学车专用标识，自学用车不得搭载随车指导人员以外的其他人员。\n　　'),(40,'第四十条 初次申请机动车驾驶证或者申请增加准驾车型的，申请人预约考试科目二，应当符合下列规定：\n　　（一）报考小型汽车、小型自动挡汽车、低速载货汽车、三轮汽车、残疾人专用小型自动挡载客汽车、轮式自行机械车、无轨电车、有轨电车准驾车型的，在取得学习驾驶证明满十日后预约考试；\n　　（二）报考大型客车、牵引车、城市公交车、中型客车、大型货车准驾车型的，在取得学习驾驶证明满二十日后预约考试。\n　　'),(41,'第四十一条 初次申请机动车驾驶证或者申请增加准驾车型的，申请人预约考试科目三，应当符合下列规定：\n　　（一）报考低速载货汽车、三轮汽车、轮式自行机械车、无轨电车、有轨电车准驾车型的，在取得学习驾驶证明满二十日后预约考试；\n　　（二）报考小型汽车、小型自动挡汽车、残疾人专用小型自动挡载客汽车准驾车型的，在取得学习驾驶证明满三十日后预约考试；\n　　（三）报考大型客车、牵引车、城市公交车、中型客车、大型货车准驾车型的，在取得学习驾驶证明满四十日后预约考试。\n　　'),(42,'第四十二条 持军队、武装警察部队或者境外机动车驾驶证申请机动车驾驶证的，应当自车辆管理所受理之日起三年内完成科目考试。\n　　'),(43,'第四十三条 申请人因故不能按照预约时间参加考试的，应当提前一日申请取消预约。对申请人未按照预约考试时间参加考试的，判定该次考试不合格。\n'),(44,'第四十四条 每个科目考试一次，考试不合格的，可以补考一次。不参加补考或者补考仍不合格的，本次考试终止，申请人应当重新预约考试，但科目二、科目三考试应当在十日后预约。科目三安全文明驾驶常识考试不合格的，已通过的道路驾驶技能考试成绩有效。\n在学习驾驶证明有效期内，科目二和科目三道路驾驶技能考试预约考试的次数不得超过五次。第五次预约考试仍不合格的，已考试合格的其他科目成绩作废。\n'),(45,'第四十五条 车辆管理所组织考试前应当使用全国统一的计算机系统当日随机选配考试员，随机安排考生分组，随机选取考试路线。\n　　'),(46,'第四十六条 从事考试工作的人员，应当持有省级公安机关交通管理部门颁发的资格证书。公安机关交通管理部门应当在车辆管理所公安民警中选拔足够数量的专职考试员，可以在公安机关交通管理部门公安民警、文职人员中配置兼职考试员。可以聘用运输企业驾驶人、警风警纪监督员等人员承担考试辅助评判和监督职责。\n　　考试员应当认真履行考试职责，严格按照规定考试，接受社会监督。在考试前应当自我介绍，讲解考试要求，核实申请人身份；考试中应当严格执行考试程序，按照考试项目和考试标准评定考试成绩；考试后应当当场公布考试成绩，讲评考试不合格原因。\n　　每个科目的考试成绩单应当有申请人和考试员的签名。未签名的不得核发机动车驾驶证。\n　　'),(47,'第四十七条 考试员、考试辅助和监管人员及考场工作人员应当严格遵守考试工作纪律，不得为不符合机动车驾驶许可条件、未经考试、考试不合格人员签注合格考试成绩，不得减少考试项目、降低评判标准或者参与、协助、纵容考试作弊，不得参与或者变相参与驾驶培训机构经营活动，不得收取驾驶培训机构、教练员、申请人的财物。\n　　'),(48,'第四十八条 直辖市、设区的市或者相当于同级的公安机关交通管理部门应当根据本地考试需求建设考场，配备足够数量的考试车辆。对考场布局、数量不能满足本地考试需求的，应当采取政府购买服务等方式使用社会考场，并按照公平竞争、择优选定的原则，依法通过公开招标等程序确定。\n　　考试场地建设、路段设置、车辆配备、设施设备配置以及考试项目、评判要求应当符合相关标准。考试场地、考试设备和考试系统应当经省级公安机关交通管理部门验收合格后方可使用。公安机关交通管理部门应当加强对辖区考场的监督管理，定期开展考试场地、考试车辆、考试设备和考场管理情况的监督检查。\n\n　　'),(49,'第四十九条 车辆管理所应当在办事大厅、候考场所和互联网公开各考场的考试能力、预约计划、预约人数和约考结果等情况，公布考场布局、考试路线和流程。考试预约计划应当至少在考试前十日在互联网上公开。\n　　车辆管理所应当在候考场所、办事大厅向群众直播考试视频，考生可以在考试结束后三日内查询自己的考试视频资料。\n　　'),(50,'第五十条 车辆管理所应当对考试过程进行全程录音、录像，并实时监控考试过程，没有使用录音、录像设备的，不得组织考试。严肃考试纪律，规范考场秩序，对考场秩序混乱的，应当中止考试。考试过程中，考试员应当使用执法记录仪记录监考过程。\n　　车辆管理所应当建立音视频信息档案，存储录音、录像设备和执法记录仪记录的音像资料。建立考试质量抽查制度，每日抽查音视频信息档案，发现存在违反考试纪律、考场秩序混乱以及音视频信息缺失或者不完整的，应当进行调查处理。\n　　省级公安机关交通管理部门应当定期抽查音视频信息档案，及时通报、纠正、查处发现的问题。\n　　'),(51,'第五十一条 车辆管理所应当根据考试场地、考试设备、考试车辆、考试员数量等实际情况，核定每个考场、每个考试员每日最大考试量。\n　　车辆管理所应当对驾驶培训机构教练员、教练车、训练场地等情况进行备案。\n　　'),(52,'第五十二条 车辆管理所应当每周通过计算机系统对机动车驾驶人考试和机动车驾驶证业务办理情况进行监控、分析。省级公安机关交通管理部门应当建立全省（自治区、直辖市）机动车驾驶人考试监管系统，每月对机动车驾驶人考试、机动车驾驶证业务办理情况进行监控、分析，及时查处、通报发现的问题。\n　　车辆管理所存在为未经考试或者考试不合格人员核发机动车驾驶证等严重违规办理机动车驾驶证业务情形的，上级公安机关交通管理部门可以暂停该车辆管理所办理相关业务或者指派其他车辆管理所人员接管业务。\n　　'),(53,'第五十三条 直辖市、设区的市或者相当于同级的公安机关交通管理部门应当每月向社会公布车辆管理所考试员考试质量情况、三年内驾龄驾驶人交通违法率和交通肇事率等信息。\n　　直辖市、设区的市或者相当于同级的公安机关交通管理部门应当每月向社会公布辖区内驾驶培训机构的考试合格率、三年内驾龄驾驶人交通违法率和交通肇事率等信息，按照考试合格率对驾驶培训机构培训质量公开排名，并通报培训主管部门。\n　　'),(54,'第五十四条 对三年内驾龄驾驶人发生一次死亡3人以上交通事故且负主要以上责任的，省级公安机关交通管理部门应当倒查车辆管理所考试、发证情况，向社会公布倒查结果。对三年内驾龄驾驶人发生一次死亡1至2人的交通事故且负主要以上责任的，直辖市、设区的市或者相当于同级的公安机关交通管理部门应当组织责任倒查。\n　　直辖市、设区的市或者相当于同级的公安机关交通管理部门发现驾驶培训机构及其教练员存在缩短培训学时、减少培训项目以及贿赂考试员、以承诺考试合格等名义向学员索取财物、参与违规办理驾驶证或者考试舞弊行为的，应当通报培训主管部门，并向社会公布。\n　　公安机关交通管理部门发现考场、考试设备生产销售企业存在组织或者参与考试舞弊、伪造或者篡改考试系统数据的，不得继续使用该考场或者采购该企业考试设备；构成犯罪的，依法追究刑事责任。\n\n　　'),(55,'第五十五条 申请人考试合格后，应当接受不少于半小时的交通安全文明驾驶常识和交通事故案例警示教育，并参加领证宣誓仪式。\n　　车辆管理所应当在申请人参加领证宣誓仪式的当日核发机动车驾驶证。属于申请增加准驾车型的，应当收回原机动车驾驶证。属于复员、转业、退伍的，应当收回军队、武装警察部队机动车驾驶证。\n　　'),(56,'第五十六条 机动车驾驶人在机动车驾驶证的六年有效期内，每个记分周期均未记满12分的，换发十年有效期的机动车驾驶证；在机动车驾驶证的十年有效期内，每个记分周期均未记满12分的，换发长期有效的机动车驾驶证。\n　　'),(57,'第五十七条 机动车驾驶人应当于机动车驾驶证有效期满前九十日内，向机动车驾驶证核发地或者核发地以外的车辆管理所申请换证。申请时应当填写申请表，并提交以下证明、凭证：\n　　（一）机动车驾驶人的身份证明；\n　　（二）机动车驾驶证；\n　　（三）县级或者部队团级以上医疗机构出具的有关身体条件的证明。属于申请残疾人专用小型自动挡载客汽车的，应当提交经省级卫生主管部门指定的专门医疗机构出具的有关身体条件的证明。\n'),(58,'第五十八条 机动车驾驶人户籍迁出原车辆管理所管辖区的，应当向迁入地车辆管理所申请换证。机动车驾驶人在核发地车辆管理所管辖区以外居住的，可以向居住地车辆管理所申请换证。申请时应当填写申请表，提交机动车驾驶人的身份证明和机动车驾驶证，并申报身体条件情况。\n　　'),(59,'第五十九条 年龄在60周岁以上的，不得驾驶大型客车、牵引车、城市公交车、中型客车、大型货车、无轨电车和有轨电车；持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的，应当到机动车驾驶证核发地或者核发地以外的车辆管理所换领准驾车型为小型汽车或者小型自动挡汽车的机动车驾驶证。\n　　年龄在70周岁以上的，不得驾驶低速载货汽车、三轮汽车、普通三轮摩托车、普通二轮摩托车和轮式自行机械车；持有普通三轮摩托车、普通二轮摩托车驾驶证的，应当到机动车驾驶证核发地或者核发地以外的车辆管理所换领准驾车型为轻便摩托车的机动车驾驶证。\n　　申请时应当填写申请表，并提交第五十七条规定的证明、凭证。\n　　机动车驾驶人自愿降低准驾车型的，应当填写申请表，并提交机动车驾驶人的身份证明和机动车驾驶证。\n　　'),(60,'第六十条 具有下列情形之一的，机动车驾驶人应当在三十日内到机动车驾驶证核发地或者核发地以外的车辆管理所申请换证：\n　　（一）在车辆管理所管辖区域内，机动车驾驶证记载的机动车驾驶人信息发生变化的；\n　　（二）机动车驾驶证损毁无法辨认的。\n　　申请时应当填写申请表，并提交机动车驾驶人的身份证明和机动车驾驶证。\n　　'),(61,'第六十一条 机动车驾驶人身体条件发生变化，不符合所持机动车驾驶证准驾车型的条件，但符合准予驾驶的其他准驾车型条件的，应当在三十日内到机动车驾驶证核发地或者核发地以外的车辆管理所申请降低准驾车型。申请时应当填写申请表，并提交机动车驾驶人的身份证明、机动车驾驶证、县级或者部队团级以上医疗机构出具的有关身体条件的证明。\n　　机动车驾驶人身体条件发生变化，不符合第十二条第二项规定或者具有第十三条规定情形之一，不适合驾驶机动车的，应当在三十日内到机动车驾驶证核发地车辆管理所申请注销。申请时应当填写申请表，并提交机动车驾驶人的身份证明和机动车驾驶证。\n　　机动车驾驶人身体条件不适合驾驶机动车的，不得驾驶机动车。\n　　'),(62,'第六十二条 车辆管理所对符合第五十七条至第六十条、第六十一条第一款规定的，应当在一日内换发机动车驾驶证。对符合第六十一条第二款规定的，应当在一日内注销机动车驾驶证。其中，对符合第五十八条至第六十一条规定的，还应当收回原机动车驾驶证。\n　　'),(63,'第六十三条 机动车驾驶证遗失的，机动车驾驶人应当向机动车驾驶证核发地或者核发地以外的车辆管理所申请补发。申请时应当填写申请表，并提交以下证明、凭证：\n　　（一）机动车驾驶人的身份证明；\n　　（二）机动车驾驶证遗失的书面声明。\n　　符合规定的，车辆管理所应当在一日内补发机动车驾驶证。\n　　机动车驾驶人补领机动车驾驶证后，原机动车驾驶证作废，不得继续使用。\n　　机动车驾驶证被依法扣押、扣留或者暂扣期间，机动车驾驶人不得申请补发。\n　　'),(64,'第六十四条 机动车驾驶人向核发地以外的车辆管理所申请办理第五十七条、第五十九条、第六十条、第六十一条第一款、第六十三条规定的换证、补证业务时，应当同时按照第五十八条规定办理。\n\n　　'),(65,'第六十五条 道路交通安全违法行为累积记分周期（即记分周期）为12个月，满分为12分，从机动车驾驶证初次领取之日起计算。\n　　依据道路交通安全违法行为的严重程度，一次记分的分值为：12分、6分、3分、2分、1分五种（附件4）。\n　　'),(66,'第六十六条 对机动车驾驶人的道路交通安全违法行为，处罚与记分同时执行。\n　　机动车驾驶人一次有两个以上违法行为记分的，应当分别计算，累加分值。\n　　'),(67,'第六十七条 机动车驾驶人对道路交通安全违法行为处罚不服，申请行政复议或者提起行政诉讼后，经依法裁决变更或者撤销原处罚决定的，相应记分分值予以变更或者撤销。\n　　'),(68,'第六十八条 机动车驾驶人在一个记分周期内累积记分达到12分的，公安机关交通管理部门应当扣留其机动车驾驶证。\n　　机动车驾驶人应当在十五日内到机动车驾驶证核发地或者违法行为地公安机关交通管理部门参加为期七日的道路交通安全法律、法规和相关知识学习。机动车驾驶人参加学习后，车辆管理所应当在二十日内对其进行道路交通安全法律、法规和相关知识考试。考试合格的，记分予以清除，发还机动车驾驶证；考试不合格的，继续参加学习和考试。拒不参加学习，也不接受考试的，由公安机关交通管理部门公告其机动车驾驶证停止使用。\n　　机动车驾驶人在一个记分周期内有两次以上达到12分或者累积记分达到24分以上的，车辆管理所还应当在道路交通安全法律、法规和相关知识考试合格后十日内对其进行道路驾驶技能考试。接受道路驾驶技能考试的，按照本人机动车驾驶证载明的最高准驾车型考试。\n　　'),(69,'第六十九条 机动车驾驶人在一个记分周期内记分未达到12分，所处罚款已经缴纳的，记分予以清除；记分虽未达到12分，但尚有罚款未缴纳的，记分转入下一记分周期。\n　　'),(70,'第七十条 机动车驾驶人应当按照法律、行政法规的规定，定期到公安机关交通管理部门接受审验。\n　　机动车驾驶人按照本规定第五十七条、第五十八条换领机动车驾驶证时，应当接受公安机关交通管理部门的审验。\n　　持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的驾驶人，应当在每个记分周期结束后三十日内到公安机关交通管理部门接受审验。但在一个记分周期内没有记分记录的，免予本记分周期审验。\n　　持有本条第三款规定以外准驾车型驾驶证的驾驶人，发生交通事故造成人员死亡承担同等以上责任未被吊销机动车驾驶证的，应当在本记分周期结束后三十日内到公安机关交通管理部门接受审验。\n　　机动车驾驶人可以在机动车驾驶证核发地或者核发地以外的地方参加审验、提交身体条件证明。\n　　'),(71,'第七十一条 机动车驾驶证审验内容包括：\n　　（一）道路交通安全违法行为、交通事故处理情况；\n　　（二）身体条件情况；\n　　（三）道路交通安全违法行为记分及记满12分后参加学习和考试情况。\n　　持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证一个记分周期内有记分的，以及持有其他准驾车型驾驶证发生交通事故造成人员死亡承担同等以上责任未被吊销机动车驾驶证的驾驶人，审验时应当参加不少于三小时的道路交通安全法律法规、交通安全文明驾驶、应急处置等知识学习，并接受交通事故案例警示教育。\n　　对交通违法行为或者交通事故未处理完毕的、身体条件不符合驾驶许可条件的、未按照规定参加学习、教育和考试的，不予通过审验。\n　　'),(72,'第七十二条 年龄在70周岁以上的机动车驾驶人，应当每年进行一次身体检查，在记分周期结束后三十日内，提交县级或者部队团级以上医疗机构出具的有关身体条件的证明。\n　　持有残疾人专用小型自动挡载客汽车驾驶证的机动车驾驶人，应当每三年进行一次身体检查，在记分周期结束后三十日内，提交经省级卫生主管部门指定的专门医疗机构出具的有关身体条件的证明。\n　　机动车驾驶人按照本规定第七十条第三款、第四款规定参加审验时，应当申报身体条件情况。\n　　'),(73,'第七十三条 机动车驾驶人因服兵役、出国（境）等原因，无法在规定时间内办理驾驶证期满换证、审验、提交身体条件证明的，可以向机动车驾驶证核发地车辆管理所申请延期办理。申请时应当填写申请表，并提交机动车驾驶人的身份证明、机动车驾驶证和延期事由证明。\n　　延期期限最长不超过三年。延期期间机动车驾驶人不得驾驶机动车。\n　　'),(74,'第七十四条 机动车驾驶人初次申请机动车驾驶证和增加准驾车型后的12个月为实习期。\n　　新取得大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的，实习期结束后三十日内应当参加道路交通安全法律法规、交通安全文明驾驶、应急处置等知识考试，并接受不少于半小时的交通事故案例警示教育。\n　　在实习期内驾驶机动车的，应当在车身后部粘贴或者悬挂统一式样的实习标志（附件5）。\n　　'),(75,'第七十五条 机动车驾驶人在实习期内不得驾驶公共汽车、营运客车或者执行任务的警车、消防车、救护车、工程救险车以及载有爆炸物品、易燃易爆化学物品、剧毒或者放射性等危险物品的机动车；驾驶的机动车不得牵引挂车。\n　　驾驶人在实习期内驾驶机动车上高速公路行驶，应当由持相应或者更高准驾车型驾驶证三年以上的驾驶人陪同。其中，驾驶残疾人专用小型自动挡载客汽车的，可以由持有小型自动挡载客汽车以上准驾车型驾驶证的驾驶人陪同。\n　　在增加准驾车型后的实习期内，驾驶原准驾车型的机动车时不受上述限制。\n　　'),(76,'第七十六条 持有准驾车型为残疾人专用小型自动挡载客汽车的机动车驾驶人驾驶机动车时，应当按规定在车身设置残疾人机动车专用标志（附件6）。\n　　有听力障碍的机动车驾驶人驾驶机动车时，应当佩戴助听设备。\n　　'),(77,'第七十七条 机动车驾驶人具有下列情形之一的，车辆管理所应当注销其机动车驾驶证：\n　　（一）死亡的；\n　　（二）提出注销申请的；\n　　（三）丧失民事行为能力，监护人提出注销申请的；\n　　（四）身体条件不适合驾驶机动车的；\n　　（五）有器质性心脏病、癫痫病、美尼尔氏症、眩晕症、癔病、震颤麻痹、精神病、痴呆以及影响肢体活动的神经系统疾病等妨碍安全驾驶疾病的；\n　　（六）被查获有吸食、注射毒品后驾驶机动车行为，正在执行社区戒毒、强制隔离戒毒、社区康复措施，或者长期服用依赖性精神药品成瘾尚未戒除的；\n　　（七）超过机动车驾驶证有效期一年以上未换证的；\n　　（八）年龄在70周岁以上，在一个记分周期结束后一年内未提交身体条件证明的；或者持有残疾人专用小型自动挡载客汽车准驾车型，在三个记分周期结束后一年内未提交身体条件证明的；\n　　（九）年龄在60周岁以上，所持机动车驾驶证只具有无轨电车或者有轨电车准驾车型，或者年龄在70周岁以上，所持机动车驾驶证只具有低速载货汽车、三轮汽车、轮式自行机械车准驾车型的；\n　　（十）机动车驾驶证依法被吊销或者驾驶许可依法被撤销的。\n　　有第一款第二项至第十项情形之一，未收回机动车驾驶证的，应当公告机动车驾驶证作废。\n　　有第一款第七项情形被注销机动车驾驶证未超过二年的，机动车驾驶人参加道路交通安全法律、法规和相关知识考试合格后，可以恢复驾驶资格。\n　　有第一款第八项情形被注销机动车驾驶证，机动车驾驶证在有效期内或者超过有效期不满一年的，机动车驾驶人提交身体条件证明后，可以恢复驾驶资格。\n　　有第一款第二项至第八项情形之一，按照第二十四条规定申请机动车驾驶证，有道路交通安全违法行为或者交通事故未处理记录的，应当将道路交通安全违法行为、交通事故处理完毕。\n　　'),(78,'第七十八条 持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的驾驶人有下列情形之一的，车辆管理所应当注销其最高准驾车型驾驶资格，并通知机动车驾驶人在三十日内办理降级换证业务：\n　　（一）发生交通事故造成人员死亡，承担同等以上责任，未构成犯罪的；\n　　（二）在一个记分周期内有记满12分记录的；\n　　（三）连续三个记分周期不参加审验的。\n　　机动车驾驶人在规定时间内未办理降级换证业务的，车辆管理所应当公告注销的准驾车型驾驶资格作废。\n　　机动车驾驶人办理降级换证业务后，申请增加被注销的准驾车型的，应当在本记分周期和申请前最近一个记分周期没有记满12分记录，且没有发生造成人员死亡承担同等以上责任的交通事故。\n　　'),(79,'第七十九条 机动车驾驶人在实习期内发生道路交通安全违法行为被记满12分的，注销其实习的准驾车型驾驶资格。被注销的驾驶资格不属于最高准驾车型的，还应当按照第七十八条第一款规定，注销其最高准驾车型驾驶资格。\n　　持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的驾驶人在一年实习期内记6分以上但未达到12分的，实习期限延长一年。在延长的实习期内再次记6分以上但未达到12分的，注销其实习的准驾车型驾驶资格。\n　　'),(80,'第八十条 机动车驾驶人联系电话、联系地址等信息发生变化，以及持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的驾驶人从业单位等信息发生变化的，应当在信息变更后三十日内，向驾驶证核发地车辆管理所备案。\n　　'),(81,'第八十一条 道路运输企业应当定期将聘用的机动车驾驶人向所在地公安机关交通管理部门备案，督促及时处理道路交通安全违法行为、交通事故和参加机动车驾驶证审验。\n　　公安机关交通管理部门应当每月向辖区内交通运输主管部门、运输企业通报机动车驾驶人的道路交通违法行为、记分和交通事故等情况。\n\n　　'),(82,'第八十二条 校车驾驶人应当依法取得校车驾驶资格。\n　　取得校车驾驶资格应当符合下列条件：\n　　（一）取得相应准驾车型驾驶证并具有三年以上驾驶经历，年龄在25周岁以上、不超过60周岁；\n　　（二）最近连续三个记分周期内没有被记满12分记录；\n　　（三）无致人死亡或者重伤的交通事故责任记录；\n　　（四）无酒后驾驶或者醉酒驾驶机动车记录，最近一年内无驾驶客运车辆超员、超速等严重交通违法行为记录；\n　　（五）无犯罪记录；\n　　（六）身心健康，无传染性疾病，无癫痫病、精神病等可能危及行车安全的疾病病史，无酗酒、吸毒行为记录。\n　　'),(83,'第八十三条 机动车驾驶人申请取得校车驾驶资格，应当向县级或者设区的市级公安机关交通管理部门提出申请，填写申请表，并提交以下证明、凭证：\n　　（一）申请人的身份证明；\n　　（二）机动车驾驶证；\n　　（三）县级或者部队团级以上医疗机构出具的有关身体条件的证明。\n　　'),(84,'第八十四条 公安机关交通管理部门自受理申请之日起五日内审查提交的证明、凭证，并向所在地县级公安机关核查，确认申请人无犯罪、吸毒行为记录。对符合条件的，在机动车驾驶证上签注准许驾驶校车及相应车型，并通报教育行政部门；不符合条件的，应当书面说明理由。\n　　'),(85,'第八十五条 校车驾驶人应当在每个记分周期结束后三十日内到公安机关交通管理部门接受审验。审验时，应当提交县级或者部队团级以上医疗机构出具的有关身体条件的证明，参加不少于三小时的道路交通安全法律法规、交通安全文明驾驶、应急处置等知识学习，并接受交通事故案例警示教育。\n　　'),(86,'第八十六条 公安机关交通管理部门应当与教育行政部门和学校建立校车驾驶人的信息交换机制，每月通报校车驾驶人的交通违法、交通事故和审验等情况。\n　　'),(87,'第八十七条 校车驾驶人具有下列情形之一的，公安机关交通管理部门应当注销其校车驾驶资格，通知机动车驾驶人换领机动车驾驶证，并通报教育行政部门和学校：\n　　（一）提出注销申请的；\n　　（二）年龄超过60周岁的；\n　　（三）在致人死亡或者重伤的交通事故负有责任的；\n　　（四）有酒后驾驶或者醉酒驾驶机动车，以及驾驶客运车辆超员、超速等严重交通违法行为的；\n　　（五）有记满12分或者犯罪记录的；\n　　（六）有传染性疾病，癫痫病、精神病等可能危及行车安全的疾病，有酗酒、吸毒行为记录的。\n　　未收回签注校车驾驶许可的机动车驾驶证的，应当公告其校车驾驶资格作废。\n　　'),(88,'第八十八条 隐瞒有关情况或者提供虚假材料申领机动车驾驶证的，申请人在一年内不得再次申领机动车驾驶证。\n　　申请人在考试过程中有贿赂、舞弊行为的，取消考试资格，已经通过考试的其他科目成绩无效；申请人在一年内不得再次申领机动车驾驶证。\n　　申请人以欺骗、贿赂等不正当手段取得机动车驾驶证的，公安机关交通管理部门收缴机动车驾驶证，撤销机动车驾驶许可；申请人在三年内不得再次申领机动车驾驶证。\n　　'),(89,'第八十九条 申请人在教练员或者学车专用标识签注的指导人员随车指导下，使用符合规定的机动车学习驾驶中有道路交通安全违法行为或者发生交通事故的，按照《道路交通安全法实施条例》第二十条规定，由教练员或者随车指导人员承担责任。\n　　'),(90,'第九十条 申请人在道路上学习驾驶时，未按照第三十九条规定随身携带学习驾驶证明，由公安机关交通管理部门处二十元以上二百元以下罚款。\n　　'),(91,'第九十一条 申请人在道路上学习驾驶时，有下列情形之一的，由公安机关交通管理部门对教练员或者随车指导人员处二十元以上二百元以下罚款：\n　　（一）未按照公安机关交通管理部门指定的路线、时间进行的；\n　　（二）未按照第三十九条规定放置、粘贴学车专用标识的。\n　　'),(92,'第九十二条 申请人在道路上学习驾驶时，有下列情形之一的，由公安机关交通管理部门对教练员或者随车指导人员处二百元以上五百元以下罚款：\n　　（一）未使用符合规定的机动车的；\n　　（二）自学用车搭载随车指导人员以外的其他人员的。\n　　'),(93,'第九十三条 申请人在道路上学习驾驶时，有下列情形之一的，由公安机关交通管理部门按照《道路交通安全法》第九十九条第一款第一项规定予以处罚：\n　　（一）未取得学习驾驶证明的；\n　　（二）学习驾驶证明超过有效期的；\n　　（三）没有教练员或者随车指导人员的；\n　　（四）由不符合规定的人员随车指导的。\n　　将机动车交由有前款规定情形之一的申请人驾驶的，由公安机关交通管理部门按照《道路交通安全法》第九十九条第一款第二项规定予以处罚。\n　　'),(94,'第九十四条 机动车驾驶人有下列行为之一的，由公安机关交通管理部门处二十元以上二百元以下罚款：\n　　（一）机动车驾驶人补领机动车驾驶证后，继续使用原机动车驾驶证的；\n　　（二）在实习期内驾驶机动车不符合第七十五条规定的；\n　　（三）驾驶机动车未按规定粘贴、悬挂实习标志或者残疾人机动车专用标志的；\n　　（四）持有大型客车、牵引车、城市公交车、中型客车、大型货车驾驶证的驾驶人，未按照第八十条规定申报变更信息的；\n　　有第一款第一项规定情形的，由公安机关交通管理部门收回原机动车驾驶证。\n　　'),(95,'第九十五条 机动车驾驶人有下列行为之一的，由公安机关交通管理部门处二百元以上五百元以下罚款：\n　　（一）机动车驾驶证被依法扣押、扣留或者暂扣期间，采用隐瞒、欺骗手段补领机动车驾驶证的；\n　　（二）机动车驾驶人身体条件发生变化不适合驾驶机动车，仍驾驶机动车的；\n　　（三）逾期不参加审验仍驾驶机动车的。\n　　有第一款第一项、第二项规定情形之一的，由公安机关交通管理部门收回机动车驾驶证。\n　　'),(96,'第九十六条 伪造、变造或者使用伪造、变造的机动车驾驶证的，由公安机关交通管理部门予以收缴，依法拘留，并处二千元以上五千元以下罚款；构成犯罪的，依法追究刑事责任。\n　　'),(97,'第九十七条 交通警察有下列情形之一的，按照有关规定给予纪律处分；聘用人员有下列情形之一的予以解聘。构成犯罪的，依法追究刑事责任：\n　　（一）为不符合机动车驾驶许可条件、未经考试、考试不合格人员签注合格考试成绩或者核发机动车驾驶证的；\n　　（二）减少考试项目、降低评判标准或者参与、协助、纵容考试作弊的；\n　　（三）为不符合规定的申请人发放学习驾驶证明、学车专用标识的；\n　　（四）与非法中介串通谋取经济利益的；\n　　（五）违反规定侵入机动车驾驶证管理系统，泄漏、篡改、买卖系统数据，或者泄漏系统密码的；\n　　（六）参与或者变相参与驾驶培训机构经营活动的；\n　　（七）收取驾驶培训机构、教练员、申请人或者其他相关人员财物的。\n　　交通警察未按照第五十条第一款规定使用执法记录仪的，根据情节轻重，按照有关规定给予纪律处分。\n　　公安机关交通管理部门有本条第一款所列行为之一的，按照国家有关规定对直接负责的主管人员和其他直接责任人员给予相应的处分。\n　　'),(98,'第九十八条 国家之间对机动车驾驶证有互相认可协议的，按照协议办理。\n　　国家之间签订有关协定涉及机动车驾驶证的，按照协定执行。\n　　'),(99,'第九十九条 机动车驾驶人可以委托代理人代理换证、补证、提交身体条件证明、延期办理和注销业务。代理人申请机动车驾驶证业务时，应当提交代理人的身份证明和机动车驾驶人与代理人共同签字的申请表或者身体条件证明。\n　　'),(100,'第一百条 机动车驾驶证和学习驾驶证明的式样、规格按照中华人民共和国公共安全行业标准《中华人民共和国机动车驾驶证件》执行。\n　　'),(101,'第一百零一条 身体条件证明自出具之日起6个月内有效。\n　　'),(102,'第一百零二条 拖拉机驾驶证的申领和使用另行规定。拖拉机驾驶证式样、规格应当符合中华人民共和国公共安全行业标准《中华人民共和国机动车驾驶证件》的规定。\n　　'),(103,'第一百零三条 本规定下列用语的含义：\n　　（一）身份证明是指：\n　　1、居民的身份证明，是《居民身份证》或者《临时居民身份证》。在户籍地以外居住的内地居民，按照第十九条、第二十一条、第二十二条、第八十三条规定提交的身份证明，是《居民身份证》或者《临时居民身份证》，以及公安机关核发的居住证明；\n　　2、现役军人（含武警）的身份证明，是《居民身份证》或者《临时居民身份证》。在未办理《居民身份证》前，是军队有关部门核发的《军官证》、《文职干部证》、《士兵证》、《离休证》、《退休证》等有效军人身份证件，以及其所在的团级以上单位出具的本人住所证明；\n　　3、香港、澳门特别行政区居民的身份证明，是其入境时所持有的《港澳居民来往内地通行证》或者外交部核发的《中华人民共和国旅行证》，香港、澳门特别行政区《居民身份证》和公安机关核发的住宿登记证明；\n　　4、台湾地区居民的身份证明，是其所持有的公安机关核发的五年有效的《台湾居民来往大陆通行证》或者外交部核发的《中华人民共和国旅行证》和公安机关核发的住宿登记证明；\n　　5、华侨的身份证明，是《中华人民共和国护照》和公安机关核发的住宿登记证明；\n　　6、外国人的身份证明，是其入境时所持有的护照或者其他旅行证件、居（停）留期为三个月以上的有效签证或者停留、居留证件，以及公安机关核发的住宿登记证明；\n　　7、外国驻华使馆、领馆人员、国际组织驻华代表机构人员的身份证明，是外交部核发的有效身份证件。\n　　（二）住址是指：\n　　1、居民的住址，是《居民身份证》或者《临时居民身份证》记载的住址；\n　　2、现役军人（含武警）的住址，是《居民身份证》或者《临时居民身份证》记载的住址。在未办理《居民身份证》前，是其所在的团级以上单位出具的本人住所证明记载的住址；\n　　3、境外人员的住址，是公安机关核发的住宿登记证明记载的地址；\n　　4、外国驻华使馆、领馆人员及国际组织驻华代表机构人员的住址，是外交部核发的有效身份证件记载的地址。\n　　（三）境外机动车驾驶证是指外国、香港、澳门特别行政区、台湾地区核发的具有单独驾驶资格的机动车驾驶证。\n　　'),(104,'第一百零四条 本规定所称“以上”、“以下”均包含本数在内。\n　　本规定所称“一日”、 “五日”、“七日”、“十日”、“十五日”，是指工作日，不包括节假日。\n　　'),(105,'第一百零五条 本规定自2013年1月1日起施行，第五章第四节自发布之日起施行。2006年12月20日发布的《机动车驾驶证申领和使用规定》（公安部令第91号）和2009年12月7日发布的《公安部关于修改<机动车驾驶证申领和使用规定>的决定》（公安部令第111号）同时废止。本规定生效后，公安部以前制定的规定与本规定不一致的，以本规定为准。\n');
/*!40000 ALTER TABLE `wp_law_jiashizhengguiding` ENABLE KEYS */;

#
# Structure for table "wp_law_jidongcheguiding"
#

DROP TABLE IF EXISTS `wp_law_jidongcheguiding`;
CREATE TABLE `wp_law_jidongcheguiding` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `法律条文` text,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=66 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;

#
# Data for table "wp_law_jidongcheguiding"
