/*!40000 ALTER TABLE `wp_law_jidongcheguiding` DISABLE KEYS */;
INSERT INTO `wp_law_jidongcheguiding` VALUES (1,'第一条 根据《中华人民共和国道路交通安全法》及其实施条例的规定，制定本规定。'),(2,'第二条 本规定由公安机关交通管理部门负责实施。省级公安机关交通管理部门负责本省（自治区、直辖市）机动车登记工作的指导、检查和监督。直辖市公安机关交通管理部门车辆管理所、设区的市或者相当于同级的公安机关交通管理部门车辆管理所负责办理本行政辖区内机动车登记业务。县级公安机关交通管理部门车辆管理所可以办理本行政辖区内摩托车、三轮汽车、低速载货汽车登记业务。条件具备的，可以办理除进口机动车、危险化学品运输车、校车、中型以上载客汽车以外的其他机动车登记业务。具体业务范围和办理条件由省级公安机关交通管理部门确定。警用车辆登记业务按照有关规定办理。'),(3,'第三条 车辆管理所办理机动车登记，应当遵循公开、公正、便民的原则。车辆管理所在受理机动车登记申请时，对申请材料齐全并符合法律、行政法规和本规定的，应当在规定的时限内办结。对申请材料不齐全或者其他不符合法定形式的，应当一次告知申请人需要补正的全部内容。对不符合规定的，应当书面告知不予受理、登记的理由。车辆管理所应当将法律、行政法规和本规定的有关机动车登记的事项、条件、依据、程序、期限以及收费标准、需要提交的全部材料的目录和申请表示范文本等在办理登记的场所公示。省级、设区的市或者相当于同级的公安机关交通管理部门应当在互联网上建立主页，发布信息，便于群众查阅机动车登记的有关规定，下载、使用有关表格。'),(4,'第四条 车辆管理所应当使用计算机登记系统办理机动车登记，并建立数据库。不使用计算机登记系统登记的，登记无效。计算机登记系统的数据库标准和登记软件全国统一。数据库能够完整、准确记录登记内容，记录办理过程和经办人员信息，并能够实时将有关登记内容传送到全国公安交通管理信息系统。计算机登记系统应当与交通违法信息系统和交通事故信息系统实行联网。'),(5,'第五条 初次申领机动车号牌、行驶证的，机动车所有人应当向住所地的车辆管理所申请注册登记。'),(6,'第六条 机动车所有人应当到机动车安全技术检验机构对机动车进行安全技术检验，取得机动车安全技术检验合格证明后申请注册登记。但经海关进口的机动车和国务院机动车产品主管部门认定免予安全技术检验的机动车除外。免予安全技术检验的机动车有下列情形之一的，应当进行安全技术检验：（一）国产机动车出厂后两年内未申请注册登记的；（二）经海关进口的机动车进口后两年内未申请注册登记的；（三）申请注册登记前发生交通事故的。专用校车办理注册登记前，应当按照专用校车国家安全技术标准进行安全技术检验。'),(7,'第七条 申请注册登记的，机动车所有人应当填写申请表，交验机动车，并提交以下证明、凭证：（一）机动车所有人的身份证明；（二）购车发票等机动车来历证明；（三）机动车整车出厂合格证明或者进口机动车进口凭证；（四）车辆购置税完税证明或者免税凭证；（五）机动车交通事故责任强制保险凭证；（六）车船税纳税或者免税证明；（七）法律、行政法规规定应当在机动车注册登记时提交的其他证明、凭证。不属于经海关进口的机动车和国务院机动车产品主管部门规定免予安全技术检验的机动车，还应当提交机动车安全技术检验合格证明。车辆管理所应当自受理申请之日起二日内，确认机动车，核对车辆识别代号拓印膜，审查提交的证明、凭证，核发机动车登记证书、号牌、行驶证和检验合格标志。'),(8,'第八条 车辆管理所办理消防车、救护车、工程救险车注册登记时，应当对车辆的使用性质、标志图案、标志灯具和警报器进行审查。车辆管理所办理全挂汽车列车和半挂汽车列车注册登记时，应当对牵引车和挂车分别核发机动车登记证书、号牌和行驶证。'),(9,'第九条 有下列情形之一的，不予办理注册登记：（一）机动车所有人提交的证明、凭证无效的；（二）机动车来历证明被涂改或者机动车来历证明记载的机动车所有人与身份证明不符的；（三）机动车所有人提交的证明、凭证与机动车不符的；（四）机动车未经国务院机动车产品主管部门许可生产或者未经国家进口机动车主管部门许可进口的；（五）机动车的有关技术数据与国务院机动车产品主管部门公告的数据不符的；（六）机动车的型号、发动机号码、车辆识别代号或者有关技术数据不符合国家安全技术标准的；（七）机动车达到国家规定的强制报废标准的；（八）机动车被人民法院、人民检察院、行政执法部门依法查封、扣押的；（九）机动车属于被盗抢的；（十）其他不符合法律、行政法规规定的情形。'),(10,'第十条 已注册登记的机动车有下列情形之一的，机动车所有人应当向登记地车辆管理所申请变更登记：（一）改变车身颜色的；（二）更换发动机的；（三）更换车身或者车架的；（四）因质量问题更换整车的；（五）营运机动车改为非营运机动车或者非营运机动车改为营运机动车等使用性质改变的；（六）机动车所有人的住所迁出或者迁入车辆管理所管辖区域的。机动车所有人为两人以上，需要将登记的所有人姓名变更为其他所有人姓名的，可以向登记地车辆管理所申请变更登记。属于本条第一款第（一）项、第（二）项和第（三）项规定的变更事项的，机动车所有人应当在变更后十日内向车辆管理所申请变更登记；属于本条第一款第（六）项规定的变更事项的，机动车所有人申请转出前，应当将涉及该车的道路交通安全违法行为和交通事故处理完毕。'),(11,'第十一条 申请变更登记的，机动车所有人应当填写申请表，交验机动车，并提交以下证明、凭证：（一）机动车所有人的身份证明；（二）机动车登记证书；（三）机动车行驶证；（四）属于更换发动机、车身或者车架的，还应当提交机动车安全技术检验合格证明；（五）属于因质量问题更换整车的，还应当提交机动车安全技术检验合格证明，但经海关进口的机动车和国务院机动车产品主管部门认定免予安全技术检验的机动车除外。车辆管理所应当自受理之日起一日内，确认机动车，审查提交的证明、凭证，在机动车登记证书上签注变更事项，收回行驶证，重新核发行驶证。车辆管理所办理本规定第十条第一款第（三）项、第（四）项和第（六）项规定的变更登记事项的，应当核对车辆识别代号拓印膜。'),(12,'第十二条 车辆管理所办理机动车变更登记时，需要改变机动车号牌号码的，收回号牌、行驶证，确定新的机动车号牌号码，重新核发号牌、行驶证和检验合格标志。'),(13,'第十三条 机动车所有人的住所迁出车辆管理所管辖区域的，车辆管理所应当自受理之日起三日内，在机动车登记证书上签注变更事项，收回号牌、行驶证，核发有效期为三十日的临时行驶车号牌，将机动车档案交机动车所有人。机动车所有人应当在临时行驶车号牌的有效期限内到住所地车辆管理所申请机动车转入。申请机动车转入的，机动车所有人应当填写申请表，提交身份证明、机动车登记证书、机动车档案，并交验机动车。机动车在转入时已超过检验有效期的，应当在转入地进行安全技术检验并提交机动车安全技术检验合格证明和交通事故责任强制保险凭证。车辆管理所应当自受理之日起三日内，确认机动车，核对车辆识别代号拓印膜，审查相关证明、凭证和机动车档案，在机动车登记证书上签注转入信息，核发号牌、行驶证和检验合格标志。'),(14,'第十四条 机动车所有人为两人以上，需要将登记的所有人姓名变更为其他所有人姓名的，应当提交机动车登记证书、行驶证、变更前和变更后机动车所有人的身份证明和共同所有的公证证明，但属于夫妻双方共同所有的，可以提供《结婚证》或者证明夫妻关系的《居民户口簿》。变更后机动车所有人的住所在车辆管理所管辖区域内的，车辆管理所按照本规定第十一条第二款的规定办理变更登记。变更后机动车所有人的住所不在车辆管理所管辖区域内的，迁出地和迁入地车辆管理所按照本规定第十三条的规定办理变更登记。'),(15,'第十五条 有下列情形之一的，不予办理变更登记：（一）改变机动车的品牌、型号和发动机型号的，但经国务院机动车产品主管部门许可选装的发动机除外；（二）改变已登记的机动车外形和有关技术数据的，但法律、法规和国家强制性标准另有规定的除外；（三）有本规定第九条第（一）项、第（七）项、第（八）项、第（九）项规定情形的。'),(16,'第十六条 有下列情形之一，在不影响安全和识别号牌的情况下，机动车所有人不需要办理变更登记：（一）小型、微型载客汽车加装前后防撞装置；（二）货运机动车加装防风罩、水箱、工具箱、备胎架等；（三）增加机动车车内装饰。'),(17,'第十七条 已注册登记的机动车，机动车所有人住所在车辆管理所管辖区域内迁移或者机动车所有人姓名（单位名称）、联系方式变更的，应当向登记地车辆管理所备案。（一）机动车所有人住所在车辆管理所管辖区域内迁移、机动车所有人姓名（单位名称）变更的，机动车所有人应当提交身份证明、机动车登记证书、行驶证和相关变更证明。车辆管理所应当自受理之日起一日内，在机动车登记证书上签注备案事项，重新核发行驶证。（二）机动车所有人联系方式变更的，机动车所有人应当提交身份证明和行驶证。车辆管理所应当自受理之日起一日内办理备案。机动车所有人的身份证明名称或者号码变更的，可以向登记地车辆管理所申请备案。机动车所有人应当提交身份证明、机动车登记证书。车辆管理所应当自受理之日起一日内，在机动车登记证书上签注备案事项。发动机号码、车辆识别代号因磨损、锈蚀、事故等原因辨认不清或者损坏的，可以向登记地车辆管理所申请备案。机动车所有人应当提交身份证明、机动车登记证书、行驶证。车辆管理所应当自受理之日起一日内，在发动机、车身或者车架上打刻原发动机号码或者原车辆识别代号，在机动车登记证书上签注备案事项。　'),(18,'第十八条 已注册登记的机动车所有权发生转移的，现机动车所有人应当自机动车交付之日起三十日内向登记地车辆管理所申请转移登记。机动车所有人申请转移登记前，应当将涉及该车的道路交通安全违法行为和交通事故处理完毕。'),(19,'第十九条 申请转移登记的，现机动车所有人应当填写申请表，交验机动车，并提交以下证明、凭证：（一）现机动车所有人的身份证明；（二）机动车所有权转移的证明、凭证；（三）机动车登记证书；（四）机动车行驶证；（五）属于海关监管的机动车，还应当提交《中华人民共和国海关监管车辆解除监管证明书》或者海关批准的转让证明；（六）属于超过检验有效期的机动车，还应当提交机动车安全技术检验合格证明和交通事故责任强制保险凭证。现机动车所有人住所在车辆管理所管辖区域内的，车辆管理所应当自受理申请之日起一日内，确认机动车，核对车辆识别代号拓印膜，审查提交的证明、凭证，收回号牌、行驶证，确定新的机动车号牌号码，在机动车登记证书上签注转移事项，重新核发号牌、行驶证和检验合格标志。现机动车所有人住所不在车辆管理所管辖区域内的，车辆管理所应当按照本规定第十三条的规定办理。'),(20,'第二十条 有下列情形之一的，不予办理转移登记：（一）机动车与该车档案记载内容不一致的；（二）属于海关监管的机动车，海关未解除监管或者批准转让的；（三）机动车在抵押登记、质押备案期间的；（四）有本规定第九条第（一）项、第（二）项、第（七）项、第（八）项、第（九）项规定情形的。'),(21,'第二十一条 被人民法院、人民检察院和行政执法部门依法没收并拍卖，或者被仲裁机构依法仲裁裁决，或者被人民法院调解、裁定、判决机动车所有权转移时，原机动车所有人未向现机动车所有人提供机动车登记证书、号牌或者行驶证的，现机动车所有人在办理转移登记时，应当提交人民法院出具的未得到机动车登记证书、号牌或者行驶证的《协助执行通知书》，或者人民检察院、行政执法部门出具的未得到机动车登记证书、号牌或者行驶证的证明。车辆管理所应当公告原机动车登记证书、号牌或者行驶证作废，并在办理转移登记的同时，补发机动车登记证书。'),(22,'第二十二条 机动车所有人将机动车作为抵押物抵押的，应当向登记地车辆管理所申请抵押登记；抵押权消灭的，应当向登记地车辆管理所申请解除抵押登记。'),(23,'第二十三条 申请抵押登记的，机动车所有人应当填写申请表，由机动车所有人和抵押权人共同申请，并提交下列证明、凭证：（一）机动车所有人和抵押权人的身份证明；（二）机动车登记证书；（三）机动车所有人和抵押权人依法订立的主合同和抵押合同。车辆管理所应当自受理之日起一日内，审查提交的证明、凭证，在机动车登记证书上签注抵押登记的内容和日期。'),(24,'第二十四条 申请解除抵押登记的，机动车所有人应当填写申请表，由机动车所有人和抵押权人共同申请，并提交下列证明、凭证：（一）机动车所有人和抵押权人的身份证明；（二）机动车登记证书。人民法院调解、裁定、判决解除抵押的，机动车所有人或者抵押权人应当填写申请表，提交机动车登记证书、人民法院出具的已经生效的《调解书》、《裁定书》或者《判决书》，以及相应的《协助执行通知书》。车辆管理所应当自受理之日起一日内，审查提交的证明、凭证，在机动车登记证书上签注解除抵押登记的内容和日期。'),(25,'第二十五条 机动车抵押登记日期、解除抵押登记日期可以供公众查询。'),(26,'第二十六条 有本规定第九条第（一）项、第（七）项、第（八）项、第（九）项或者第二十条第（二）项规定情形之一的，不予办理抵押登记。对机动车所有人提交的证明、凭证无效，或者机动车被人民法院、人民检察院、行政执法部门依法查封、扣押的，不予办理解除抵押登记。'),(27,'第二十七条 已达到国家强制报废标准的机动车，机动车所有人向机动车回收企业交售机动车时，应当填写申请表，提交机动车登记证书、号牌和行驶证。机动车回收企业应当确认机动车并解体，向机动车所有人出具《报废机动车回收证明》。报废的校车、大型客、货车及其他营运车辆应当在车辆管理所的监督下解体。机动车回收企业应当在机动车解体后七日内将申请表、机动车登记证书、号牌、行驶证和《报废机动车回收证明》副本提交车辆管理所，申请注销登记。车辆管理所应当自受理之日起一日内，审查提交的证明、凭证，收回机动车登记证书、号牌、行驶证，出具注销证明。'),(28,'第二十八条 除本规定第二十七条规定的情形外，机动车有下列情形之一的，机动车所有人应当向登记地车辆管理所申请注销登记：（一）机动车灭失的；（二）机动车因故不在我国境内使用的；（三）因质量问题退车的。已注册登记的机动车有下列情形之一的，登记地车辆管理所应当办理注销登记：（一）机动车登记被依法撤销的；（二）达到国家强制报废标准的机动车被依法收缴并强制报废的。属于本条第一款第（二）项和第（三）项规定情形之一的，机动车所有人申请注销登记前，应当将涉及该车的道路交通安全违法行为和交通事故处理完毕。'),(29,'第二十九条 属于本规定第二十八条第一款规定的情形，机动车所有人申请注销登记的，应当填写申请表，并提交以下证明、凭证：（一）机动车登记证书；（二）机动车行驶证；（三）属于机动车灭失的，还应当提交机动车所有人的身份证明和机动车灭失证明；（四）属于机动车因故不在我国境内使用的，还应当提交机动车所有人的身份证明和出境证明，其中属于海关监管的机动车，还应当提交海关出具的《中华人民共和国海关监管车辆进（出）境领（销）牌照通知书》；（五）属于因质量问题退车的，还应当提交机动车所有人的身份证明和机动车制造厂或者经销商出具的退车证明。车辆管理所应当自受理之日起一日内，审查提交的证明、凭证，收回机动车登记证书、号牌、行驶证，出具注销证明。'),(30,'第三十条 因车辆损坏无法驶回登记地的，机动车所有人可以向车辆所在地机动车回收企业交售报废机动车。交售机动车时应当填写申请表，提交机动车登记证书、号牌和行驶证。机动车回收企业应当确认机动车并解体，向机动车所有人出具《报废机动车回收证明》。报废的校车、大型客、货车及其他营运车辆应当在报废地车辆管理所的监督下解体。机动车回收企业应当在机动车解体后七日内将申请表、机动车登记证书、号牌、行驶证和《报废机动车回收证明》副本提交报废地车辆管理所，申请注销登记。报废地车辆管理所应当自受理之日起一日内，审查提交的证明、凭证，收回机动车登记证书、号牌、行驶证，并通过计算机登记系统将机动车报废信息传递给登记地车辆管理所。登记地车辆管理所应当自接到机动车报废信息之日起一日内办理注销登记，并出具注销证明。'),(31,'第三十一条 已注册登记的机动车有下列情形之一的，车辆管理所应当公告机动车登记证书、号牌、行驶证作废：（一）达到国家强制报废标准，机动车所有人逾期不办理注销登记的；（二）机动车登记被依法撤销后，未收缴机动车登记证书、号牌、行驶证的；（三）达到国家强制报废标准的机动车被依法收缴并强制报废的；（四）机动车所有人办理注销登记时未交回机动车登记证书、号牌、行驶证的。'),(32,'第三十二条 有本规定第九条第（一）项、第（八）项、第（九）项或者第二十条第（一）项、第（三）项规定情形之一的，不予办理注销登记。'),(33,'第三十三条 学校或者校车服务提供者申请校车使用许可，应当按照《校车安全管理条例》向县级或者设区的市级人民政府教育行政部门提出申请。公安机关交通管理部门收到教育行政部门送来的征求意见材料后，应当在一日内通知申请人交验机动车。'),(34,'第三十四条 县级或者设区的市级公安机关交通管理部门应当自申请人交验机动车之日起二日内确认机动车，查验校车标志灯、停车指示标志、卫星定位装置以及逃生锤、干粉灭火器、急救箱等安全设备，审核行驶线路、开行时间和停靠站点。属于专用校车的，还应当查验校车外观标识。审查以下证明、凭证：（一）机动车所有人的身份证明；（二）机动车行驶证；（三）校车安全技术检验合格证明；（四）包括行驶线路、开行时间和停靠站点的校车运行方案；（五）校车驾驶人的机动车驾驶证。公安机关交通管理部门应当自收到教育行政部门征求意见材料之日起三日内向教育行政部门回复意见，但申请人未按规定交验机动车的除外。'),(35,'第三十五条 学校或者校车服务提供者按照《校车安全管理条例》取得校车使用许可后，应当向县级或者设区的市级公安机关交通管理部门领取校车标牌。领取时应当填写表格，并提交以下证明、凭证：（一）机动车所有人的身份证明；（二）校车驾驶人的机动车驾驶证；（三）机动车行驶证；（四）县级或者设区的市级人民政府批准的校车使用许可；（五）县级或者设区的市级人民政府批准的包括行驶线路、开行时间和停靠站点的校车运行方案。公安机关交通管理部门应当在收到领取表之日起三日内核发校车标牌。对属于专用校车的，应当核对行驶证上记载的校车类型和核载人数；对不属于专用校车的，应当在行驶证副页上签注校车类型和核载人数。'),(36,'第三十六条 校车标牌应当记载本车的号牌号码、机动车所有人、驾驶人、行驶线路、开行时间、停靠站点、发牌单位、有效期限等信息。校车标牌分前后两块，分别放置于前风窗玻璃右下角和后风窗玻璃适当位置。校车标牌有效期的截止日期与校车安全技术检验有效期的截止日期一致，但不得超过校车使用许可有效期。'),(37,'第三十七条 专用校车应当自注册登记之日起每半年进行一次安全技术检验，非专用校车应当自取得校车标牌后每半年进行一次安全技术检验。学校或者校车服务提供者应当在校车检验有效期满前一个月内向公安机关交通管理部门申请检验合格标志。公安机关交通管理部门应当自受理之日起一日内，确认机动车，审查提交的证明、凭证，核发检验合格标志，换发校车标牌。'),(38,'第三十八条 已取得校车标牌的机动车达到报废标准或者不再作为校车使用的，学校或者校车服务提供者应当拆除校车标志灯、停车指示标志，消除校车外观标识，并将校车标牌交回核发的公安机关交通管理部门。专用校车不得改变使用性质。校车使用许可被吊销、注销或者撤销的，学校或者校车服务提供者应当拆除校车标志灯、停车指示标志，消除校车外观标识，并将校车标牌交回核发的公安机关交通管理部门。'),(39,'第三十九条 校车行驶线路、开行时间、停靠站点或者车辆、所有人、驾驶人发生变化的，经县级或者设区的市级人民政府批准后，应当按照本规定重新领取校车标牌。'),(40,'第四十条 公安机关交通管理部门应当每月将校车标牌的发放、变更、收回等信息报本级人民政府备案，并通报教育行政部门。学校或者校车服务提供者应当自取得校车标牌之日起，每月查询校车道路交通安全违法行为记录，及时到公安机关交通管理部门接受处理。核发校车标牌的公安机关交通管理部门应当每月汇总辖区内校车道路交通安全违法和交通事故等情况，通知学校或者校车服务提供者，并通报教育行政部门。'),(41,'第四十一条　校车标牌灭失、丢失或者损毁的，学校或者校车服务提供者应当向核发标牌的公安机关交通管理部门申请补领或者换领。申请时，应当提交机动车所有人的身份证明及机动车行驶证。公安机关交通管理部门应当自受理之日起三日内审核，补发或者换发校车标牌。'),(42,'第四十二条 申请办理机动车质押备案或者解除质押备案的，由机动车所有人和典当行共同申请，机动车所有人应当填写申请表，并提交以下证明、凭证：（一）机动车所有人和典当行的身份证明；（二）机动车登记证书。车辆管理所应当自受理之日起一日内，审查提交的证明、凭证，在机动车登记证书上签注质押备案或者解除质押备案的内容和日期。有本规定第九条第（一）项、第（七）项、第（八）项、第（九）项规定情形之一的，不予办理质押备案。对机动车所有人提交的证明、凭证无效，或者机动车被人民法院、人民检察院、行政执法部门依法查封、扣押的，不予办理解除质押备案。'),(43,'第四十三条 机动车登记证书灭失、丢失或者损毁的，机动车所有人应当向登记地车辆管理所申请补领、换领。申请时，机动车所有人应当填写申请表并提交身份证明，属于补领机动车登记证书的，还应当交验机动车。车辆管理所应当自受理之日起一日内，确认机动车，审查提交的证明、凭证，补发、换发机动车登记证书。启用机动车登记证书前已注册登记的机动车未申领机动车登记证书的，机动车所有人可以向登记地车辆管理所申领机动车登记证书。但属于机动车所有人申请变更、转移或者抵押登记的，应当在申请前向车辆管理所申领机动车登记证书。申请时，机动车所有人应当填写申请表，交验机动车并提交身份证明。车辆管理所应当自受理之日起五日内，确认机动车，核对车辆识别代号拓印膜，审查提交的证明、凭证，核发机动车登记证书。'),(44,'第四十四条 机动车号牌、行驶证灭失、丢失或者损毁的，机动车所有人应当向登记地车辆管理所申请补领、换领。申请时，机动车所有人应当填写申请表并提交身份证明。车辆管理所应当审查提交的证明、凭证，收回未灭失、丢失或者损毁的号牌、行驶证，自受理之日起一日内补发、换发行驶证，自受理之日起十五日内补发、换发号牌，原机动车号牌号码不变。补发、换发号牌期间应当核发有效期不超过十五日的临时行驶车号牌。'),(45,'第四十五条 机动车具有下列情形之一，需要临时上道路行驶的，机动车所有人应当向车辆管理所申领临时行驶车号牌：（一）未销售的；（二）购买、调拨、赠予等方式获得机动车后尚未注册登记的；（三）进行科研、定型试验的；（四）因轴荷、总质量、外廓尺寸超出国家标准不予办理注册登记的特型机动车。'),(46,'第四十六条 机动车所有人申领临时行驶车号牌应当提交以下证明、凭证：（一）机动车所有人的身份证明；（二）机动车交通事故责任强制保险凭证；（三）属于本规定第四十五条第（一）项、第（四）项规定情形的，还应当提交机动车整车出厂合格证明或者进口机动车进口凭证；（四）属于本规定第四十五条第（二）项规定情形的，还应当提交机动车来历证明，以及机动车整车出厂合格证明或者进口机动车进口凭证；（五）属于本规定第四十五条第（三）项规定情形的，还应当提交书面申请和机动车安全技术检验合格证明。车辆管理所应当自受理之日起一日内，审查提交的证明、凭证，属于本规定第四十五条第（一）项、第（二）项规定情形，需要在本行政辖区内临时行驶的，核发有效期不超过十五日的临时行驶车号牌；需要跨行政辖区临时行驶的，核发有效期不超过三十日的临时行驶车号牌。属于本规定第四十五条第（三）项、第（四）项规定情形的，核发有效期不超过九十日的临时行驶车号牌。因号牌制作的原因，无法在规定时限内核发号牌的，车辆管理所应当核发有效期不超过十五日的临时行驶车号牌。对具有本规定第四十五条第（一）项、第（二）项规定情形之一，机动车所有人需要多次申领临时行驶车号牌的，车辆管理所核发临时行驶车号牌不得超过三次。'),(47,'第四十七条 机动车所有人发现登记内容有错误的，应当及时要求车辆管理所更正。车辆管理所应当自受理之日起五日内予以确认。确属登记错误的，在机动车登记证书上更正相关内容，换发行驶证。需要改变机动车号牌号码的，应当收回号牌、行驶证，确定新的机动车号牌号码，重新核发号牌、行驶证和检验合格标志。'),(48,'第四十八条 已注册登记的机动车被盗抢的，车辆管理所应当根据刑侦部门提供的情况，在计算机登记系统内记录，停止办理该车的各项登记和业务。被盗抢机动车发还后，车辆管理所应当恢复办理该车的各项登记和业务。机动车在被盗抢期间，发动机号码、车辆识别代号或者车身颜色被改变的，车辆管理所应当凭有关技术鉴定证明办理变更备案。'),(49,'第四十九条 机动车所有人可以在机动车检验有效期满前三个月内向登记地车辆管理所申请检验合格标志。申请前，机动车所有人应当将涉及该车的道路交通安全违法行为和交通事故处理完毕。申请时，机动车所有人应当填写申请表并提交行驶证、机动车交通事故责任强制保险凭证、车船税纳税或者免税证明、机动车安全技术检验合格证明。车辆管理所应当自受理之日起一日内，确认机动车，审查提交的证明、凭证，核发检验合格标志。'),(50,'第五十条 除大型载客汽车、校车以外的机动车因故不能在登记地检验的，机动车所有人可以向登记地车辆管理所申请委托核发检验合格标志。申请前，机动车所有人应当将涉及机动车的道路交通安全违法行为和交通事故处理完毕。申请时，应当提交机动车登记证书或者行驶证。车辆管理所应当自受理之日起一日内，出具核发检验合格标志的委托书。机动车在检验地检验合格后，机动车所有人应当按照本规定第四十九条第二款的规定向被委托地车辆管理所申请检验合格标志，并提交核发检验合格标志的委托书。被委托地车辆管理所应当自受理之日起一日内，按照本规定第四十九条第三款的规定核发检验合格标志。营运货车长期在登记以外的地区从事道路运输的，机动车所有人向营运地车辆管理所备案登记一年后，可以在营运地直接进行安全技术检验，并向营运地车辆管理所申请检验合格标志。'),(51,'第五十一条 机动车检验合格标志灭失、丢失或者损毁的，机动车所有人应当持行驶证向机动车登记地或者检验合格标志核发地车辆管理所申请补领或者换领。车辆管理所应当自受理之日起一日内补发或者换发。'),(52,'第五十二条 办理机动车转移登记或者注销登记后，原机动车所有人申请办理新购机动车注册登记时，可以向车辆管理所申请使用原机动车号牌号码。申请使用原机动车号牌号码应当符合下列条件：（一）在办理转移登记或者注销登记后六个月内提出申请；（二）机动车所有人拥有原机动车三年以上；（三）涉及原机动车的道路交通安全违法行为和交通事故处理完毕。'),(53,'第五十三条 确定机动车号牌号码采用计算机自动选取和由机动车所有人按照机动车号牌标准规定自行编排的方式。'),(54,'第五十四条 机动车所有人可以委托代理人代理申请各项机动车登记和业务，但申请补领机动车登记证书的除外。对机动车所有人因死亡、出境、重病、伤残或者不可抗力等原因不能到场申请补领机动车登记证书的，可以凭相关证明委托代理人代理申领。代理人申请机动车登记和业务时，应当提交代理人的身份证明和机动车所有人的书面委托。'),(55,'第五十五条 机动车所有人或者代理人申请机动车登记和业务，应当如实向车辆管理所提交规定的材料和反映真实情况，并对其申请材料实质内容的真实性负责。　'),(56,'第五十六条 有下列情形之一的，由公安机关交通管理部门处警告或者二百元以下罚款：（一）重型、中型载货汽车及其挂车的车身或者车厢后部未按照规定喷涂放大的牌号或者放大的牌号不清晰的；（二）机动车喷涂、粘贴标识或者车身广告，影响安全驾驶的；（三）载货汽车、挂车未按照规定安装侧面及后下部防护装置、粘贴车身反光标识的；（四）机动车未按照规定期限进行安全技术检验的；（五）改变车身颜色、更换发动机、车身或者车架，未按照本规定第十条规定的时限办理变更登记的；（六）机动车所有权转移后，现机动车所有人未按照本规定第十八条规定的时限办理转移登记的；（七）机动车所有人办理变更登记、转移登记，机动车档案转出登记地车辆管理所后，未按照本规定第十三条规定的时限到住所地车辆管理所申请机动车转入的。'),(57,'第五十七条 除本规定第十条和第十六条规定的情形外，擅自改变机动车外形和已登记的有关技术数据的，由公安机关交通管理部门责令恢复原状，并处警告或者五百元以下罚款。'),(58,'第五十八条 以欺骗、贿赂等不正当手段取得机动车登记的，由公安机关交通管理部门收缴机动车登记证书、号牌、行驶证，撤销机动车登记；申请人在三年内不得申请机动车登记。对涉嫌走私、盗抢的机动车，移交有关部门处理。以欺骗、贿赂等不正当手段办理补、换领机动车登记证书、号牌、行驶证和检验合格标志等业务的，由公安机关交通管理部门处警告或者二百元以下罚款。'),(59,'第五十九条 省、自治区、直辖市公安厅、局可以根据本地区的实际情况，在本规定的处罚幅度范围内，制定具体的执行标准。对本规定的道路交通安全违法行为的处理程序按照《道路交通安全违法行为处理程序规定》执行。'),(60,'第六十条 交通警察违反规定为被盗抢、走私、非法拼（组）装、达到国家强制报废标准的机动车办理登记的，按照国家有关规定给予处分，经教育不改又不宜给予开除处分的，按照《公安机关组织管理条例》规定予以辞退；对聘用人员予以解聘。构成犯罪的，依法追究刑事责任。'),(61,'第六十一条 交通警察有下列情形之一的，按照国家有关规定给予处分；对聘用人员予以解聘。构成犯罪的，依法追究刑事责任：（一）不按照规定确认机动车和审查证明、凭证的；（二）故意刁难，拖延或者拒绝办理机动车登记的；（三）违反本规定增加机动车登记条件或者提交的证明、凭证的；（四）违反本规定第五十三条的规定，采用其他方式确定机动车号牌号码的；（五）违反规定跨行政辖区办理机动车登记和业务的；（六）超越职权进入计算机登记系统办理机动车登记和业务，或者不按规定使用机动车登记系统办理登记和业务的；（七）向他人泄漏、传播计算机登记系统密码，造成系统数据被篡改、丢失或者破坏的；（八）利用职务上的便利索取、收受他人财物或者谋取其他利益的；（九）强令车辆管理所违反本规定办理机动车登记的。'),(62,'第六十二条 公安机关交通管理部门有本规定第六十条、第六十一条所列行为之一的，按照国家有关规定对直接负责的主管人员和其他直接责任人员给予相应的处分。公安机关交通管理部门及其工作人员有本规定第六十条、第六十一条所列行为之一，给当事人造成损失的，应当依法承担赔偿责任。　'),(63,'第六十三条 机动车登记证书、号牌、行驶证、检验合格标志的种类、式样，以及各类登记表格式样等由公安部制定。机动车登记证书由公安部统一印制。机动车登记证书、号牌、行驶证、检验合格标志的制作应当符合有关标准。'),(64,'第六十四条 本规定下列用语的含义：（一）进口机动车是指：1.经国家限定口岸海关进口的汽车；2.经各口岸海关进口的其他机动车；3.海关监管的机动车；4.国家授权的执法部门没收的走私、无合法进口证明和利用进口关键件非法拼（组）装的机动车。（二）进口机动车的进口凭证是指：1.进口汽车的进口凭证，是国家限定口岸海关签发的《货物进口证明书》；2.其他进口机动车的进口凭证，是各口岸海关签发的《货物进口证明书》；3.海关监管的机动车的进口凭证，是监管地海关出具的《中华人民共和国海关监管车辆进（出）境领（销）牌照通知书》；4.国家授权的执法部门没收的走私、无进口证明和利用进口关键件非法拼（组）装的机动车的进口凭证，是该部门签发的《没收走私汽车、摩托车证明书》。（三）机动车所有人是指拥有机动车的个人或者单位。1.个人是指我国内地的居民和军人（含武警）以及香港、澳门特别行政区、台湾地区居民、华侨和外国人；2.单位是指机关、企业、事业单位和社会团体以及外国驻华使馆、领馆和外国驻华办事机构、国际组织驻华代表机构。（四）身份证明是指：1.机关、企业、事业单位、社会团体的身份证明，是该单位的《组织机构代码证书》、加盖单位公章的委托书和被委托人的身份证明。机动车所有人为单位的内设机构，本身不具备领取《组织机构代码证书》条件的，可以使用上级单位的《组织机构代码证书》作为机动车所有人的身份证明。上述单位已注销、撤销或者破产，其机动车需要办理变更登记、转移登记、解除抵押登记、注销登记、解除质押备案、申领机动车登记证书和补、换领机动车登记证书、号牌、行驶证的，已注销的企业的身份证明，是工商行政管理部门出具的注销证明。已撤销的机关、事业单位、社会团体的身份证明，是其上级主管机关出具的有关证明。已破产的企业的身份证明，是依法成立的财产清算机构出具的有关证明；2.外国驻华使馆、领馆和外国驻华办事机构、国际组织驻华代表机构的身份证明，是该使馆、领馆或者该办事机构、代表机构出具的证明；3.居民的身份证明，是《居民身份证》或者《临时居民身份证》。在暂住地居住的内地居民，其身份证明是《居民身份证》或者《临时居民身份证》，以及公安机关核发的居住、暂住证明；4.军人（含武警）的身份证明，是《居民身份证》或者《临时居民身份证》。在未办理《居民身份证》前，是指军队有关部门核发的《军官证》、《文职干部证》、《士兵证》、《离休证》、《退休证》等有效军人身份证件，以及其所在的团级以上单位出具的本人住所证明；5.香港、澳门特别行政区居民的身份证明，是其入境时所持有的《港澳居民来往内地通行证》或者《港澳同胞回乡证》、香港、澳门特别行政区《居民身份证》和公安机关核发的居住、暂住证明；6.台湾地区居民的身份证明，是其所持有的有效期六个月以上的公安机关核发的《台湾居民来往大陆通行证》或者外交部核发的《中华人民共和国旅行证》和公安机关核发的居住、暂住证明；7.华侨的身份证明，是《中华人民共和国护照》和公安机关核发的居住、暂住证明；8.外国人的身份证明，是其入境时所持有的护照或者其他旅行证件、居（停）留期为六个月以上的有效签证或者居留许可，以及公安机关出具的住宿登记证明；9.外国驻华使馆、领馆人员、国际组织驻华代表机构人员的身份证明，是外交部核发的有效身份证件。（五）住所是指：1.单位的住所为其主要办事机构所在地的地址；2.个人的住所为其身份证明记载的地址。在暂住地居住的内地居民的住所是公安机关核发的居住、暂住证明记载的地址。（六）机动车来历证明是指：1.在国内购买的机动车，其来历证明是全国统一的机动车销售发票或者二手车交易发票。在国外购买的机动车，其来历证明是该车销售单位开具的销售发票及其翻译文本，但海关监管的机动车不需提供来历证明；2.人民法院调解、裁定或者判决转移的机动车，其来历证明是人民法院出具的已经生效的《调解书》、《裁定书》或者《判决书》，以及相应的《协助执行通知书》；3.仲裁机构仲裁裁决转移的机动车，其来历证明是《仲裁裁决书》和人民法院出具的《协助执行通知书》；4.继承、赠予、中奖、协议离婚和协议抵偿债务的机动车，其来历证明是继承、赠予、中奖、协议离婚、协议抵偿债务的相关文书和公证机关出具的《公证书》；5.资产重组或者资产整体买卖中包含的机动车，其来历证明是资产主管部门的批准文件；6.机关、企业、事业单位和社会团体统一采购并调拨到下属单位未注册登记的机动车，其来历证明是全国统一的机动车销售发票和该部门出具的调拨证明；7.机关、企业、事业单位和社会团体已注册登记并调拨到下属单位的机动车，其来历证明是该单位出具的调拨证明。被上级单位调回或者调拨到其他下属单位的机动车，其来历证明是上级单位出具的调拨证明；8.经公安机关破案发还的被盗抢且已向原机动车所有人理赔完毕的机动车，其来历证明是《权益转让证明书》。（七）机动车整车出厂合格证明是指：1.机动车整车厂生产的汽车、摩托车、挂车，其出厂合格证明是该厂出具的《机动车整车出厂合格证》；2.使用国产或者进口底盘改装的机动车，其出厂合格证明是机动车底盘生产厂出具的《机动车底盘出厂合格证》或者进口机动车底盘的进口凭证和机动车改装厂出具的《机动车整车出厂合格证》；3.使用国产或者进口整车改装的机动车，其出厂合格证明是机动车生产厂出具的《机动车整车出厂合格证》或者进口机动车的进口凭证和机动车改装厂出具的《机动车整车出厂合格证》；4.人民法院、人民检察院或者行政执法机关依法扣留、没收并拍卖的未注册登记的国产机动车，未能提供出厂合格证明的，可以凭人民法院、人民检察院或者行政执法机关出具的证明替代。（八）机动车灭失证明是指：1.因自然灾害造成机动车灭失的证明是，自然灾害发生地的街道、乡、镇以上政府部门出具的机动车因自然灾害造成灭失的证明；2.因失火造成机动车灭失的证明是，火灾发生地的县级以上公安机关消防部门出具的机动车因失火造成灭失的证明；3.因交通事故造成机动车灭失的证明是，交通事故发生地的县级以上公安机关交通管理部门出具的机动车因交通事故造成灭失的证明。（九）本规定所称“一日”、“二日”、“三日”、“五日”、“七日”、“十日”、“十五日”，是指工作日，不包括假日。临时行驶车号牌的最长有效期“十五日”、“三十日”、“九十日”，包括工作日和节假日。本规定所称以下、以上、以内，包括本数。'),(65,'第六十五条 本规定自2008年10月1日起施行。2004年4月30日公安部发布的《机动车登记规定》（公安部令第72号）同时废止。本规定实施前公安部发布的其他规定与本规定不一致的，以本规定为准。');
/*!40000 ALTER TABLE `wp_law_jidongcheguiding` ENABLE KEYS */;

#
# Structure for table "wp_law_tiaoli"
