INSERT INTO `wp_weixin_text_message` VALUES (1,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352829','1234567890123456','11101','违法代码：11100\n违法内容：未随车携带驾驶证的\n违法条款：《法》第19条第4款、第95条第1款\n处罚依据：《法》第90条、95条第1款、《办法》第41条第1项\n违法记分：1\n罚款金额：50\n强制措施类型：扣留机动车\n\n违法代码：11110\n违法内容：机动车载货长度、宽度、高度超过规定的\n违法条款：《法》第48条第1款、《条例》第54条\n处罚依据：《法》第90条、《办法》第43条第4项\n违法记分：1\n罚款金额：100\n\n查询到2条记录\n','2018-05-03 19:46:12 星期4','0.1115198135376'),(2,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352830','1234567890123456','10050','违法代码：10050\n违法内容：无有效机动车驾驶证驾驶摩托车、拖拉机、营运载客汽车以外的机动车的\n违法条款：《法》第19条第1款\n处罚依据：《法》第99条第1款第1项、第2款、《办法》第51条第3款、《条例》第104条第1项\n罚款金额：1000\n拘留天数：15\n强制措施类型：拖移机动车\n拘留标记：1\n\n查询到1条记录\n输入对应数字可查看详细内容：\n1:《法》19条;\n2:《法》99条;\n3:《办法》51条;\n4:《条例》104条;\n','2018-05-03 19:46:12 星期4','0.15746402740479'),(3,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352830','1234567890123456','2','第九十九条　有下列行为之一的，由公安机关交通管理部门处二百元以上二千元以下罚款：\n(一)未取得机动车驾驶证、机动车驾驶证被吊销或者机动车驾驶证被暂扣期间驾驶机动车的;\n(二)将机动车交由未取得机动车驾驶证或者机动车驾驶证被吊销、暂扣的人驾驶的;\n(三)造成交通事故后逃逸，尚不构成犯罪的;\n(四)机动车行驶超过规定时速百分之五十的;\n(五)强迫机动车驾驶人违反道路交通安全法律、法规和机动车安全驾驶要求驾驶机动车，造成交通事故，尚不构成犯罪的;\n(六)违反交通管制的规定强行通行，不听劝阻的;\n(七)故意损毁、移动、涂改交通设施，造成危害后果，尚不构成犯罪的;\n(八)非法拦截、扣留机动车辆，不听劝阻，造成交通严重阻塞或者较大财产损失的。\n  行为人有前款第二项、第四项情形之一的，可以并处吊销机动车驾驶证;有第一项、第三项、第五项至第八项情形之一的，可以并处十五日以下拘留。','2018-05-03 19:46:12 星期4','0.042862176895142'),(4,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352830','1234567890123456','3','第五十一条  机动车驾驶证被暂扣期间驾驶机动车的，处五百元罚款；属营运载客汽车的，处一千元罚款；属摩托车的，处二百元罚款。\n机动车驾驶证被吊销后驾驶机动车的，处八百元罚款；属营运载客汽车的，处一千五百元罚款；属摩托车的，处二百元以上四百元以下罚款。\n未取得机动车驾驶证驾驶机动车的，处一千元罚款；属营运载客汽车的，处二千元罚款；属摩托车的，处二百元以上五百元以下罚款。\n将机动车交由未取得机动车驾驶证或者机动车驾驶证被暂扣、被吊销的人驾驶的，分别按照前款规定处罚。\n','2018-05-03 19:46:12 星期4','0.04938817024231'),(5,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352831','1234567890123456','4','第一百零四条机动车驾驶人有下列行为之一，又无其他机动车驾驶人即时替代驾驶的，公安机关交通管理部门除依法给予处罚外，可以将其驾驶的机动车移至不妨碍交通的地点或者有关部门指定的地点停放：(一)不能出示本人有效驾驶证的；(二)驾驶的机动车与驾驶证载明的准驾车型不符的；(三)饮酒、服用国家管制的精神药品或者麻醉药品、患有妨碍安全驾驶的疾病，或者过度疲劳仍继续驾驶的；(四)学习驾驶人员没有教练人员随车指导单独驾驶的。','2018-05-03 19:46:12 星期4','0.049170017242432'),(6,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352831','1234567890123456','12分号牌200元','违法代码：17170\n违法内容：上道路行驶的机动车未悬挂机动车号牌的\n违法条款：《法》第11条第1款\n处罚依据：《法》第95条第1款、《法》第90条、《法》第24条1款\n违法记分：12\n罚款金额：200\n强制措施类型：扣留机动车 扣留驾驶证\n\n违法代码：17180\n违法内容：故意遮挡机动车号牌的\n违法条款：《法》第11条第2款\n处罚依据：《法》第95条第2款、第90条、第24条第1款\n违法记分：12\n罚款金额：200\n强制措施类型：扣留驾驶证\n\n违法代码：17190\n违法内容：故意污损机动车号牌的\n违法条款：《法》第11条第2款\n处罚依据：《法》第95条第2款、第90条、第24条第1款\n违法记分：12\n罚款金额：200\n强制措施类型：扣留驾驶证\n\n违法代码：17200\n违法内容：不按规定安装机动车号牌的\n违法条款：《法》第11条第2款、《条例》13条第1款\n处罚依据：《法》第95条第2款、第90条、第24条第1款、《办法》44条第4项\n违法记分：12\n罚款金额：200\n强制措施类型：扣留驾驶证\n\n查询到4条记录\n','2018-05-03 19:46:12 星期4','0.084054946899414'),(7,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352831','1234567890123456','放大号牌','代码：10880\n内容：以欺骗、贿赂等不正当手段办理补、换领机动车登记证书、号牌、行驶证和检验合格标志等业务的\n\n代码：17170\n内容：上道路行驶的机动车未悬挂机动车号牌的\n\n代码：17180\n内容：故意遮挡机动车号牌的\n\n代码：17190\n内容：故意污损机动车号牌的\n\n代码：17200\n内容：不按规定安装机动车号牌的\n\n代码：50020\n内容：伪造、变造摩托车、拖拉机机动车号牌的\n\n代码：50021\n内容：伪造、变造机动车号牌的\n\n代码：50022\n内容：伪造、变造机动车号牌的\n\n代码：50380\n内容：重型、中型载货汽车及其挂车的车身或者车厢后部未按照规定喷涂放大的牌号或者放大的牌号不清晰的\n\n代码：57011\n内容：使用伪造、变造的摩托车、拖拉机机动车号牌的\n\n代码：57012\n内容：使用伪造、变造的机动车号牌的\n\n代码：57013\n内容：使用伪造、变造的营运车辆机动车号牌的\n\n代码：57041\n内容：使用其他摩托车、拖拉机的机动车号牌的\n\n代码：57042\n内容：使用其他车辆的机动车号牌的\n\n代码：57043\n内容：使用其他运营车辆的机动车号牌的\n\n代码：60390\n内容：因号牌被盗、丢失等原因未悬挂机动车号牌的，且当事人能够出具报警记录或者受案回执单等相关证明的\n\n代码：60400\n内容：因交通事故导致车辆号牌损坏、残缺或号牌老化、褪色等非人为因素影响号牌识认的\n\n查询到25条记录\n请输入数字翻页:\n\n第① 2 页','2018-05-03 19:46:12 星期4','0.091155052185059'),(8,'gh_3236bf0536d3','oG24uwN10qZXaFm9KZLdeRj2n22j4','1525352832','1234567890123456','2','代码：60410\n内容：未按规定粘帖有效临时行驶车号牌的\n\n代码：60420\n内容：使用的号牌架内侧边缘距离号牌上汉字、字母或者数字边缘不足5mm且影响号牌识认的\n\n代码：60430\n内容：机动车已安装号牌但未使用号牌专用固封装置的\n\n代码：60450\n内容：机动车号牌不清晰、不完整的\n\n代码：70150\n内容：客运车辆未按规定喷涂放大的牌号、放大牌号不清晰的\n\n代码：70160\n内容：重中型载货汽车及其挂车未按规定喷涂放大的牌号、放大牌号不清晰的\n\n代码：70680\n内容：驾驶机动车未放置临时号牌的\n\n代码：70700\n内容：未取得临时号牌上道路行驶的\n\n查询到25条记录\n请输入数字翻页:\n\n第1 ② 页','2018-05-03 19:46:12 星期4','0.05059289932251'),(9,'gh_3236bf0